ies\npar le Pokémon. Il est également immunisé contre\nles brûlures.'),(200,'Expert Acier','Augmente la puissance des attaques de type Acier.'),(201,'Dracolère','Augmente l’Attaque Spéciale du Pokémon lorsqu’il\ntombe à la moitié de ses PV à cause d’une attaque.'),(202,'Chasse-Neige','Augmente la Vitesse du Pokémon quand il grêle.'),(203,'Longue Portée','Le Pokémon est capable d’utiliser toutes ses capacités\nsans entrer en contact direct avec sa cible.'),(204,'Hydrata-Son','Toutes les attaques sonores du Pokémon prennent\nle type Eau.'),(205,'Prioguérison','Toutes les capacités qui soignent le Pokémon\ndirectement deviennent prioritaires.'),(206,'Peau Électrique','Les capacités de type Normal deviennent de type\nÉlectrik. Leur puissance augmente légèrement.'),(207,'Surf Caudal','La Vitesse du Pokémon est doublée sur\nun Champ Électrifié.'),(208,'Banc','Le Pokémon se rassemble avec ses congénères\nquand ses PV sont élevés. Plus ses PV baissent,\nplus le banc s’amenuise.'),(209,'Fantômasque','Le déguisement qui recouvre le corps du Pokémon\nest capable de le protéger d’une attaque.'),(210,'Synergie','En battant un ennemi, ce Pokémon renforce ses liens\navec son Dresseur. Il prend alors sa Forme Sacha\net ses Sheauriken gagnent en puissance.'),(211,'Rassemblement','Lorsque le Pokémon perd la moitié de ses PV,\nses Cellules se rassemblent pour l’encourager,\nce qui lui permet de prendre sa Forme Parfaite.'),(212,'Corrosion','Permet d’empoisonner les Pokémon de type Acier\nou Poison.'),(213,'Hypersommeil','Le Pokémon rêve en permanence et ne se réveille\njamais. Il est capable d’attaquer normalement\ntout en dormant.'),(214,'Prestance Royale','L’adversaire est impressionné par la majesté du Pokémon\net ne peut pas le viser avec une attaque prioritaire.'),(215,'Expuls’Organes','Le Pokémon inflige à l’adversaire l’ayant mis K.O.\ndes dégâts égaux au nombre de PV qu’il lui restait\navant le coup de grâce.'),(216,'Danseuse','Si n’importe quel Pokémon utilise une capacité dansante,\nce Pokémon peut se mettre aussi à danser.'),(217,'Batterie','Augmente la puissance des capacités spéciales des alliés.'),(218,'Boule de Poils','Divise par deux les dégâts des attaques directes\nsubies par le Pokémon, mais double les dégâts\ndes capacités de type Feu.'),(219,'Corps Coloré','L’adversaire est abasourdi par le Pokémon et\nne peut pas le viser avec une capacité prioritaire.'),(220,'Animacœur','Augmente l’Attaque Spéciale du Pokémon\nlorsqu’un autre Pokémon est mis K.O.'),(221,'Mèche Rebelle','Baisse la Vitesse de l’attaquant lorsque le Pokémon\nsubit une attaque directe.'),(222,'Receveur','Le Pokémon reçoit le talent d’un allié mis K.O.'),(223,'Osmose','Le Pokémon acquiert le talent d’un allié mis K.O.'),(224,'Boost Chimère','Augmente la stat la plus élevée du Pokémon\ns’il met K.O. un autre Pokémon pendant son tour.'),(225,'Système Alpha','Change le type du Pokémon en fonction\nde la ROM équipée.'),(226,'Créa-Élec','Le Pokémon crée un Champ Électrifié au moment\noù il entre au combat.'),(227,'Créa-Psy','Le Pokémon crée un Champ Psychique au moment\noù il entre au combat.'),(228,'Créa-Brume','Le Pokémon crée un Champ Brumeux au moment\noù il entre au combat.'),(229,'Créa-Herbe','Le Pokémon crée un Champ Herbu au moment\noù il entre au combat.'),(230,'Métallo-Garde','Empêche les stats du Pokémon de baisser à cause\nd’une capacité ou d’un talent.'),(231,'Spectro-Bouclier','Le Pokémon reçoit moins de dégâts quand ses PV\nsont au maximum.'),(232,'Prisme-Armure','Réduit les dégâts subis lorsque le Pokémon\nest touché par une capacité super efficace.'),(233,'Cérébro-Force','Augmente encore plus les dégâts infligés\npar les attaques super efficaces.'),(234,'Lame Indomptable','Augmente l’Attaque du Pokémon quand il entre\nau combat.'),(235,'Égide Inflexible','Augmente la Défense du Pokémon quand il entre\nau combat.'),(236,'Libéro','Le Pokémon prend le type de la capacité qu’il utilise.'),(237,'Ramasse Ball','Si le Pokémon ne tient aucun objet, il ramassera\nla Poké Ball lors du premier lancer raté du combat.'),(238,'Effilochage','Quand le Pokémon est touché par une attaque,\nil dissémine des aigrettes qui diminuent la Vitesse\nde tout le monde, sauf la sienne.'),(239,'Propulseur','Permet d’ignorer l’effet des capacités\nou des talents qui attirent les capacités.'),(240,'Armure Miroir','Le Pokémon renvoie les effets réducteurs de stats\nqu’il reçoit.'),(241,'Dégobage','Quand le Pokémon utilise Surf ou Plongée, il revient\navec une proie. Lorsqu’il subit des dégâts par la suite,\nil attaque en recrachant sa proie.'),(242,'Nerfs d’Acier','Permet d’ignorer l’effet des capacités ou des talents\nqui attirent les capacités.'),(243,'Turbine','Lorsque le Pokémon est touché par des capacités\nde type Eau ou Feu, sa Vitesse augmente énormément.'),(244,'Punk Rock','Augmente la puissance des capacités basées sur le son.\nLe Pokémon ne subit que la moitié des dégâts\nquand il est touché par ce genre de capacités.'),(245,'Expul’Sable','Le Pokémon déclenche une tempête de sable\nquand il subit une attaque.'),(246,'Écailles Glacées','Le Pokémon est protégé par des écailles de glace.\nLes dégâts qu’il subit par des capacités spéciales\nsont divisés par deux.'),(247,'Mûrissement','Le Pokémon fait mûrir la Baie qu’il tient\net double ainsi son effet.'),(248,'Tête de Gel','Le glaçon sur sa tête encaisse les attaques physiques\nà la place du Pokémon, mais sa destruction modifie\nson apparence. Le glaçon se reforme quand il grêle.'),(249,'Cercle d’Énergie','Augmente la puissance des capacités des Pokémon\nqui se trouvent à proximité.'),(250,'Mimétisme','Le Pokémon adopte le même type que le terrain\nlorsqu’un champ est actif.'),(251,'Brise-Barrière','Quand le Pokémon entre au combat, les effets\nde Mur Lumière, Protection et Voile Aurore\ndisparaissent pour les alliés comme pour les ennemis.'),(252,'Boost Acier','Augmente la puissance d’Attaque des capacités\nde type Acier des Pokémon alliés.'),(253,'Corps Condamné','Lorsque le Pokémon est directement touché par\nune attaque, l’assaillant et lui tomberont K.O. dans trois\ntours, à moins qu’ils ne soient remplacés entre temps.'),(254,'Âme Vagabonde','Lorsque le Pokémon est directement touché\npar une attaque, il échange son talent avec celui\nde l’assaillant.'),(255,'Entêtement','Augmente l’Attaque, mais empêche d’utiliser\ntoute autre capacité que celle utilisée en premier\npar le Pokémon.'),(256,'Gaz Inhibiteur','Si un Pokémon avec Gaz Inhibiteur est sur le terrain,\nles effets des talents de tous les autres Pokémon\nsont annulés.'),(257,'Voile Pastel','Protège le Pokémon et ses alliés contre toutes\nles altérations de statut liées à l’empoisonnement.'),(258,'Déclic Fringale','À la fin de chaque tour, le Pokémon alterne\nentre ses formes Mode Rassasié et Mode Affamé.'),(259,'Tir Vif','Permet parfois au Pokémon d’agir en premier.'),(260,'Poing Invisible','Si le Pokémon utilise une attaque directe, celle-ci\npourra passer outre les protections de la cible.'),(261,'Breuvage Suspect','Quand il entre au combat, le Pokémon répand\nune substance qui annule les changements de stats\nde ses alliés.'),(262,'Transistor','Augmente la puissance des attaques de type Électrik.'),(263,'Dent de Dragon','Augmente la puissance des attaques de type Dragon.'),(264,'Blanche Ruade','Quand le Pokémon met un ennemi K.O., il émet\nun hennissement glaçant, ce qui augmente son Attaque.'),(265,'Sombre Ruade','Quand le Pokémon met un ennemi K.O., il émet\nun hennissement terrifiant qui augmente\nson Attaque Spéciale.'),(266,'Osmose Équine','Les talents Tension de Sylveroy et Blanche Ruade\nde Blizzeval sont cumulés.'),(267,'Osmose Équine','Les talents Tension de Sylveroy et Sombre Ruade\nde Spectreval sont cumulés.');
