INSERT INTO `pokemon` VALUES (1,120,'Stari',0.8,34.5,'Il ne se soucie guère des Pokémon poissons\nqui viennent le grignoter, car même si son corps\nest déchiqueté, il se régénère aussitôt.'),(2,57,'Colossinge',1.0,32.0,'Sa fureur prend fin quand il n’a plus personne\nà frapper. Il est difficile d’en être témoin.'),(3,86,'Otaria',1.1,90.0,'Il est à l’aise dans les endroits gelés.\nIl nage avec plaisir dans de l’eau à -10 ºC.'),(4,901,'Ursaking',2.4,290.0,''),(5,513,'Flamajou',0.6,11.0,'Il vit dans les cratères des volcans. L’intérieur de la mèche\nqu’il a sur la tête peut atteindre 300 °C.'),(6,654,'Roussil',1.0,14.5,'Quand il saisit la branche plantée dans sa queue, elle prend\nfeu par friction. Il peut communiquer avec ses congénères\nen agitant ce bâton enflammé.'),(7,599,'Tic',0.3,21.0,'Les humains auraient inventé les mécanismes\nà engrenages il y a fort longtemps, en observant\nce Pokémon.'),(8,559,'Baggiguane',0.6,11.8,'Il se protège grâce à sa peau robuste.\nOn dit que quand celle-ci ne peut plus s’étirer\ndavantage, c’est qu’il est sur le point d’évoluer.'),(9,517,'Munna',0.6,23.3,'Il se nourrit de songes et expire de la fumée\nqui prend la couleur rose si le rêve est joyeux,\nou noire s’il s’agit d’un cauchemar.'),(10,582,'Sorbébé',0.4,5.7,'On raconte qu’il est né de stalactites.\nIl gèle les alentours en soufflant de l’air à - 50 °C\npour améliorer son confort.'),(11,533,'Ouvrifier',1.2,40.0,'Il manie la poutre métallique avec habileté.\nIl est doué pour démanteler une bâtisse, mais\npeu adroit lorsqu’il s’agit d’en construire une.'),(12,600,'Clic',0.6,51.0,'Ce Pokémon symbolisant la technologie\nindustrielle est souvent utilisé dans le logo\ndes entreprises de Galar.'),(13,510,'Léopardus',1.1,37.5,'Sans un bruit, il approche ses victimes\npar-derrière pour les frapper.\nIl dispute son territoire avec les Roublenard.'),(14,620,'Shaofouine',1.4,35.5,'Ses coups de pied ultrarapides et invisibles\nà l’œil nu peuvent réduire un énorme rocher\nen poussière.'),(15,581,'Lakmécygne',1.3,24.2,'Ils se mettent à danser à la tombée de la nuit. Le Lakmécygne\nqui danse au centre est le chef de la troupe.'),(16,487,'Giratina',4.5,750.0,'Sa grande violence lui a valu d’être banni. Il observe\nles hommes en silence depuis le Monde Distorsion.'),(17,591,'Gaulet',0.6,10.5,'Ce Pokémon a tendance à très peu se déplacer.\nQuand il voit une Poké Ball abandonnée au sol,\nil reste immobile à côté.'),(18,613,'Polarhume',0.5,8.5,'Il renifle avant d’utiliser une capacité.\nLe froid intense contenu dans sa morve\nlui permet de lancer les capacités de type Glace.'),(19,476,'Tarinorme',1.4,340.0,'Il utilise ses trois petites unités pour combattre\nses ennemis et capturer ses proies. Le reste de\nson corps se contente de donner des ordres.'),(20,578,'Méios',0.6,8.0,'Étant donné que ses deux cerveaux sont rarement\nsur la même longueur d’onde, il est impossible\nde prédire son comportement.'),(21,461,'Dimoret',1.1,34.0,'Il communique avec ses semblables en gravant\ndes motifs avec ses griffes. Il existerait près\nde 500 signes différents.'),(22,135,'Voltali',0.8,24.5,'Il se charge d’ions négatifs contenus dans l’air\npour envoyer des décharges d’environ\n10 000 volts.'),(23,85,'Dodrio',1.8,85.2,'Quand une des têtes de Doduo se divise,\nil devient un Dodrio capable de courir à\n60 km/h.'),(24,468,'Togekiss',1.5,38.0,'On dit que ce Pokémon dispense ses bienfaits,\nce qui explique pourquoi il est représenté\nsur les porte-bonheurs depuis fort longtemps.'),(25,203,'Girafarig',1.5,41.5,'La tête à l’arrière de Girafarig abrite un cerveau trop petit\npour penser. En revanche, cette tête arrière n’a pas besoin\nde dormir, ce qui lui permet de monter la garde tout le temps.'),(26,11,'Chrysacier',0.7,9.9,'Bien que son corps soit entouré d’une carapace\nsolide, l’intérieur est si mou qu’il ne résisterait\npas à une attaque violente.'),(27,742,'Bombydou',0.1,0.2,'Il perçoit l’aura de son ennemi et anticipe\nses mouvements. Il parvient ainsi à éviter\nles attaques et à riposter dans la foulée.'),(28,607,'Funécire',0.3,3.1,'Plus les victimes dont il aspire l’énergie vitale\nsont jeunes, plus sa flamme grandit et luit\nlugubrement.'),(29,778,'Mimiqui',0.2,0.7,'Les malheureux chercheurs qui ont regardé\nsous son déguisement en lambeaux ont succombé\nà une mystérieuse maladie.'),(30,609,'Lugulabre',1.0,34.3,'On raconte que dans les manoirs éclairés\npar des Lugulabre, les funérailles s’enchaînent\nsans discontinuer.'),(31,772,'Type:0',1.9,120.5,'Il a été créé artificiellement d’après un Pokémon\nmythique. Il est muni d’un masque afin de contenir\nsa puissance.'),(32,548,'Chlorobule',0.5,6.6,'Plus ses feuilles sont foncées, plus il est en\nbonne santé. Il s’installe parfois dans les champs\nou les parterres de fleurs bien entretenus.'),(33,359,'Absol',1.2,47.0,'Sa capacité à pressentir le danger lui a autrefois\nvalu la réputation de porter malheur.'),(34,708,'Brocélôme',0.4,7.0,'Il imite des cris d’enfants pour pousser les adultes\nà venir se perdre au plus profond de la forêt.'),(35,743,'Rubombelle',0.2,0.5,'Il a horreur d’être trempé par la pluie.\nOn ne le voit que très rarement à Galar,\nrégion connue pour son temps couvert.'),(36,522,'Zébibron',0.8,29.8,'Sa crinière luit quand il lâche des décharges. Il module\nleur rythme et leur nombre pour communiquer avec ses pairs.'),(37,229,'Démolosse',1.4,35.0,'Ceux qui le craignaient jadis lui ont donné le\nsurnom de « messager de la Faucheuse » à\ncause de son hurlement sinistre si particulier.'),(38,241,'Écrémeuh',1.2,75.5,'Sa santé décline si on ne le trait pas tous les jours.\nLe goût de son lait varie selon la saison.'),(39,232,'Donphan',1.1,120.0,'Si Donphan décidait de charger, il pourrait détruire\nune maison. Grâce à sa force étonnante, ce Pokémon\npeut aider à déplacer les rochers et les coulées de boue\nqui bloquent les chemins de montagne.'),(40,757,'Tritox',0.6,4.8,'Il s’approche de ses proies par-derrière\net les asperge d’un gaz empoisonné avant qu’elles\nn’aient le temps de réagir, les clouant sur place.'),(41,69,'Chétiflor',0.7,4.0,'Il préfère les endroits chauds et humides.\nIl capture les Pokémon Insecte avec ses lianes\npour les dévorer.'),(42,324,'Chartor',0.5,80.4,'Les Chartor vivent en grand nombre dans\nles mines abandonnées, où ils extraient\nle charbon avec ardeur.'),(43,225,'Cadoizo',0.9,16.0,'Ce Pokémon partage facilement son repas avec\nd’autres Pokémon et avec des humains, ce qui\nl’oblige à constamment courir après la nourriture.'),(44,148,'Draco',4.0,16.5,'Il contrôle la météo en accumulant de l’énergie\ndans les orbes au bout de sa queue. Sa silhouette\nnimbée d’une aura lui confère un air mystique.'),(45,149,'Dracolosse',2.2,210.0,'On l’appelle « l’avatar de la mer ». Nombreux\nsont les navires arborant une figure de proue\nen forme de Dracolosse.'),(46,624,'Scalpion',0.5,10.2,'Il vit en meute, sous les ordres d’un Scalproie.\nIl s’entraîne sans relâche en rêvant du jour\noù il sera chef de meute à son tour.'),(47,814,'Lapyro',0.6,9.0,'Pour parfaire son jeu de jambes,\nil cueille des Baies puis drible avec,\nle tout sans se servir de ses mains.'),(48,699,'Dragmara',2.7,225.0,'Lorsqu’il se laisse emporter par sa rage,\nil relâche des bourrasques glacées\nqui gèlent tout ce qui l’entoure.'),(49,571,'Zoroark',1.6,81.1,'Les Dresseurs en manque de compagnie\nordonnent à Zoroark de leur montrer\nune illusion pour tromper leur solitude.'),(50,182,'Joliflor',0.4,5.8,'Les Joliflor se réunissent parfois pour danser.\nOn pense que c’est un rituel pour invoquer\nle soleil.'),(51,54,'Psykokwak',0.8,19.6,'Sa migraine s’intensifie à mesure que son stress\nmonte. Il libère une force psychique puissante\nqui terrasse tous ceux qui l’entourent.'),(52,825,'Coléodôme',0.4,19.5,'Il se développe dans sa coquille et se prépare\nà évoluer en sondant les alentours grâce\nà ses pouvoirs psychiques.'),(53,1,'Bulbizarre',0.7,6.9,'Quand il est jeune, il absorbe les nutriments\nconservés dans son dos pour grandir\net se développer.'),(54,47,'Parasect',1.0,29.5,'À force de voir son énergie aspirée, il semblerait\nque ce ne soit plus l’insecte qui réfléchisse,\nmais le champignon sur son dos.'),(55,337,'Séléroc',1.0,168.0,'Il a été découvert dans le cratère d’une météorite\nil y a 40 ans. Un simple regard de sa part\nendort ses ennemis.'),(56,87,'Lamantine',1.7,120.0,'Son corps entier est aussi blanc que la neige.\nIl résiste bien au froid et peut même nager\nau milieu des icebergs.'),(57,539,'Karaclée',1.4,51.0,'Après avoir suivi un entraînement intensif,\nla puissance du tranchant de sa main est telle\nqu’il peut fendre la mer en deux.'),(58,74,'Racaillou',0.4,20.0,'On en trouve près des sentiers de montagne.\nSi vous marchez dessus par inadvertance,\nils s’énervent et attaquent.'),(59,334,'Altaria',1.1,20.6,'Il est de nature aimable, mais si on le met en\ncolère, il intimide son adversaire en poussant\nun cri strident et l’attaque sans pitié.'),(60,137,'Porygon',0.8,36.5,'Ces dernières années, il s’est rendu très utile\ndans le cyberespace, qu’il arpente pour s’assurer\nqu’il n’y a aucune donnée suspecte.'),(61,611,'Incisache',1.0,36.0,'Son épiderme est dur comme une armure.\nIl est passé maître dans l’art de charger l’ennemi\ntout en le transperçant de ses crocs.'),(62,150,'Mewtwo',2.0,122.0,'Son ADN est presque le même que celui de\nMew, mais sa taille et son caractère sont très\ndifférents.'),(63,187,'Granivol',0.4,0.5,'Ce Pokémon flotte à la dérive, porté par le vent. S’il sent\nqu’un vent très fort approche, Granivol attache ses feuilles aux\nautres Granivol pour ne pas être emporté par la bourrasque.'),(64,305,'Galegon',0.9,120.0,'Les Galegon se disputent les territoires en luttant\nau corps à corps, comme le montrent les éraflures\nsur leur armure d’acier.'),(65,830,'Blancoton',0.5,2.5,'Les fils tissés à partir du duvet sur sa tête sont\nsatinés et absolument somptueux. Le textile ainsi\ncréé est typique de la région de Galar.'),(66,217,'Ursaring',1.8,125.8,'On dit que les Ursaring trouvent leur nourriture dans les cours\nd’eau et les grands arbres des forêts où ils habitent.\nCe Pokémon erre dans la forêt toute la journée pour chercher\nde la nourriture.'),(67,802,'Marshadow',0.7,22.2,'Ce Pokémon ayant la capacité de se dissimuler\ndans les ombres, il est resté très longtemps\ncaché aux yeux du monde.'),(68,822,'Bleuseille',0.8,16.0,'Après avoir surmonté tant de rudes combats,\nil a appris à déterminer avec précision\nla puissance de ses adversaires.'),(69,284,'Maskadra',0.8,3.6,'Ses antennes en forme d’ailes absorbent\nfacilement l’humidité. Par temps de pluie,\nil attend patiemment au creux d’un arbre.'),(70,407,'Roserade',0.9,14.5,'Sa main gauche administre un poison lent,\net la droite, un poison foudroyant.\nLes deux peuvent être fatals.'),(71,471,'Givrali',0.8,25.9,'Ce Pokémon exhale un vent glacial qui crée\nune neige poudreuse. Sa présence est très\nappréciée dans les stations de ski.'),(72,685,'Cupcanaille',0.8,5.0,'Sa fourrure est si aérée qu’elle le rend très doux\net très agréable au toucher, et bien plus léger\nqu’il en a l’air.'),(73,452,'Drascore',1.3,61.5,'Sa férocité lui a valu le surnom de « démon\ndu désert », mais face à un Hippodocus, il est\nparfaitement docile et évite de le provoquer.'),(74,228,'Malosse',0.6,10.8,'Si ses congénères et lui poussent de sinistres\nhurlements avant l’aube, c’est pour signaler\nleur présence à tout le monde.'),(75,760,'Chelours',2.1,135.0,'Il abat ses proies à l’aide de techniques à faire\npâlir d’envie des combattants professionnels,\npuis les emporte sous les bras dans sa tanière.'),(76,464,'Rhinastoc',2.4,282.8,'Il repousse les attaques avec ses Protecteurs et\nprofite du moment où l’adversaire est déstabilisé\npour le transpercer avec sa vrille, dont il est fier.'),(77,800,'Necrozma',2.4,230.0,'Sa quête de lumière, sa source de vie, le rend\nviolent. Il détruit tout sur son passage avec\nses rayons laser.'),(78,583,'Sorboul',1.1,41.0,'Bien qu’il gèle ses ennemis en soufflant de l’air\nà - 100 °C, sa gentillesse l’empêche de leur ôter\nla vie.'),(79,208,'Steelix',9.2,400.0,'On pense que son corps s’est transformé à force\nd’avaler le fer contenu dans la terre en creusant.'),(80,480,'Créhelf',0.3,0.3,'On dit que sa venue a fourni aux humains le bon sens\nnécessaire pour améliorer leur existence.'),(81,793,'Zéroïd',1.2,55.5,'Il est venu dans ce monde à travers une\nUltra-Brèche. Tel un parasite, il aurait besoin\nd’un hôte, Pokémon ou humain, pour survivre.'),(82,572,'Chinchidou',0.4,5.8,'Les Chinchidou se saluent en se frottant la queue.\nCelui qui a la plus volumineuse en tire\nune certaine fierté.'),(83,594,'Mamanbo',1.2,31.6,'On pense qu’il protège les Pokémon affaiblis\nparce qu’il partage avec eux les mêmes\nprédateurs.'),(84,565,'Mégapagos',1.2,81.0,'Bien qu’il soit moins à l’aise sur terre que dans\nl’eau, il s’aventure sur le rivage pour se nourrir.'),(85,169,'Nostenfer',1.8,75.0,'Il vole en contrôlant librement ses quatre ailes\net peut se déplacer sans avoir besoin de ralentir,\nmême dans les grottes étroites.'),(86,296,'Makuhita',1.0,86.4,'Il existerait un plat mijoté traditionnel que\nles Dresseurs cuisinent pour rendre leur\nMakuhita encore plus fort.'),(87,19,'Rattata',0.3,3.5,'Il peut ronger n’importe quoi avec ses\ndeux dents. Quand on en voit un, il y en\na certainement 40 dans le coin.'),(88,331,'Cacnea',0.4,51.3,'Si son environnement est aride et difficile, la fleur de Cacnea\ndevient plus jolie et dégage un parfum délicat. Ce Pokémon\nse bat en agitant ses bras épineux.'),(89,541,'Couverdure',0.5,7.3,'Il se protège du froid en s’emmitouflant dans une feuille.\nIl se déplace en forêt et mange les feuilles tombées par terre.'),(90,730,'Oratoria',1.8,44.0,'Les combats sont une véritable performance\nartistique, pour lui. Les spectateurs sont charmés\npar son chant et la danse de ses ballons.'),(91,320,'Wailmer',2.0,130.0,'Il ressemble à un énorme ballon quand il avale\nde très grandes quantités d’eau de mer.\nIl dévore une tonne de nourriture par jour.'),(92,297,'Hariyama',2.3,253.8,'Les Hariyama les plus forts ne sont pas\nforcément les plus grands. Les petits gabarits\naussi ont plus d’un tour dans leur sac.'),(93,590,'Trompignon',0.2,1.0,'Les spores qu’il libère de ses mains sont\ntrès toxiques, mais si on les sèche bien,\nelles peuvent soulager les maux de ventre.'),(94,51,'Triopikeur',0.7,33.3,'Ce trio de Taupiqueur est capable de creuser\njusqu’à 100 km sous terre, vers l’inconnu.'),(95,810,'Ouistempo',0.3,5.0,'Il attaque en frappant frénétiquement avec\nson bâton. Son enthousiasme grandit à mesure\nque le rythme s’accélère.'),(96,166,'Coxyclaque',1.4,35.6,'Il vole dans le ciel nocturne en répandant une\npoudre scintillante. Si elle vous touche, quelque\nchose de positif devrait bientôt vous arriver.'),(97,843,'Dunaja',2.2,7.6,'En expulsant du sable par les narines, il aveugle\nson adversaire et en profite pour se cacher\nsous terre.'),(98,619,'Kungfouine',0.9,20.0,'De nature brutale malgré sa petite taille, il inflige\nune série de coups majestueux aux inconscients\nqui s’approchent trop près de lui.'),(99,474,'Porygon-Z',0.9,34.0,'On dit qu’un nouveau programme l’a fait évoluer,\nmais les avis des scientifiques divergent quant à\nsavoir s’il s’agit réellement d’une évolution.'),(100,350,'Milobellus',6.2,162.0,'On dit que la beauté de ce Pokémon est telle\nqu’elle apaise l’esprit de ceux qui le voient.'),(101,55,'Akwakwak',1.7,76.6,'D’après de vieilles légendes, ce Pokémon\nentraînait au fond de l’eau tous ceux\nqui osaient souiller sa rivière.'),(102,2,'Herbizarre',1.0,13.0,'La lumière du soleil le rend plus fort et vigoureux.\nLe bulbe sur son dos grossit en conséquence.'),(103,326,'Groret',0.9,71.5,'Groret utilise les perles noires sur son corps pour exercer\nses formidables pouvoirs. Quand il est en action, il entame\nune étrange danse. Les perles noires de ce Pokémon\nont une valeur inestimable.'),(104,10,'Chenipan',0.3,2.9,'Ses petites pattes munies de ventouses\nlui permettent de monter les pentes\net de grimper aux murs sans se fatiguer.'),(105,627,'Furaiglon',0.5,10.5,'Sa poigne est telle qu’il peut réduire en miettes\nles plus dures des Baies. Belliqueux de nature,\nil n’hésite pas à défier tout le monde.'),(106,580,'Couaneton',0.5,5.5,'Un Pokémon doué pour la plongée qui passe son temps\nsous l’eau à chercher des sphaignes, son plat préféré.'),(107,734,'Manglouton',0.4,6.0,'Il mange de tout, mais aime particulièrement\nles proies fraîches, voire encore vives. Il erre\nsur les routes à leur recherche.'),(108,286,'Chapignon',1.2,39.2,'Les graines autour de la queue de Chapignon sont des spores\ntoxiques. Elles sont totalement immangeables. Une simple\nbouchée d’une graine de ce Pokémon peut causer\nde grandes douleurs à l’estomac.'),(109,36,'Mélodelfe',1.3,40.0,'Capable d’entendre une aiguille tomber à plus\nd’un kilomètre, ce Pokémon préfère les endroits\ncalmes et isolés.'),(110,408,'Kranidos',0.9,31.5,'Son crâne extrêmement solide est sa principale\ncaractéristique. Il s’en servait pour faire tomber\ndes arbres les Baies dont il se nourrissait.'),(111,395,'Pingoléon',1.7,84.5,'Les trois cornes de son bec sont le symbole de sa force.\nCelles du chef sont plus grosses que les autres.'),(112,107,'Tygnon',1.4,50.2,'Ses poings fendent l’air, mais il se fatigue au bout\nde trois minutes à enchaîner les coups.'),(113,833,'Khélocrok',0.3,8.5,'La corne sur sa tête est aussi dure que la roche.\nIl s’en sert pour se battre et lorsque l’ennemi\nflanche, il le mord et ne le lâche plus.'),(114,224,'Octillery',0.9,28.5,'Il capture ses ennemis avec ses tentacules\net les écrase ensuite avec sa tête dure comme\nla pierre.'),(115,520,'Colombeau',0.6,15.0,'Il est intelligent et possède une bonne mémoire.\nOn raconte que les livreurs le choisissent souvent\ncomme partenaire.'),(116,835,'Voltoutou',0.3,13.5,'Ce glouton assiste les humains dans leur travail\nen échange de friandises. Il court sans arrêt,\nle corps enveloppé d’électricité.'),(117,710,'Pitrouille',0.4,5.0,'Il peut manipuler les humains et les Pokémon\nen les hypnotisant grâce à la lumière qui filtre\npar les trous de son ventre en forme de citrouille.'),(118,502,'Mateloutre',0.8,24.5,'Chaque Mateloutre a sa propre technique d’escrime\nau coupillage, acquise grâce à un entraînement drastique.'),(119,81,'Magnéti',0.3,6.0,'Il se nourrit d’électricité et flotte dans les airs\nen libérant des ondes électromagnétiques avec\nles aimants situés de part et d’autre de son corps.'),(120,124,'Lippoutou',1.4,40.6,'Les Lippoutou vivant à Galar sont souvent dotés\nd’une belle voix cristalline, ce qui leur vaut\nd’attirer des fans.'),(121,668,'Némélios',1.5,81.5,'Son souffle enflammé atteint les 6 000 °C,\nmais il ne l’utilise jamais contre ses proies.\nIl préfère en effet la viande crue.'),(122,172,'Pichu',0.3,2.0,'Les poches électriques de ses joues sont\ntrès petites. Lorsqu’elles sont surchargées,\nil s’électrocute lui-même.'),(123,740,'Crabominable',1.7,180.0,'Agir ou réfléchir ? Crabominable choisit de\nfrapper ! On raconte qu’il serait déjà parvenu\nà repousser une avalanche à coups de pince.'),(124,803,'Vémini',0.6,1.8,'Cette Ultra-Chimère venue d’un autre monde\nricane lorsqu’elle asperge ses proies de venin\ngrâce au dard qu’elle a sur la tête.'),(125,332,'Cacturne',1.3,77.4,'Lorsqu’un voyageur traverse le désert au milieu de la nuit,\nles Cacturne le suivent en groupe. Ces Pokémon attendent\nle bon moment, quand le voyageur est fatigué et qu’il n’est\nplus capable de bouger.'),(126,152,'Germignon',0.9,6.4,'Lorsqu’il se bat, Germignon secoue sa feuille pour tenir son\nennemi à distance. Un doux parfum s’en dégage également,\napaisant les Pokémon qui se battent et créant une atmosphère\nagréable et amicale.'),(127,542,'Manternel',1.2,20.5,'Il réchauffe les Œufs avec la chaleur de l’humus. Il fabrique\ndes langes pour les Larveyette avec des feuilles.'),(128,207,'Scorplane',1.1,64.8,'Scorplane plane dans les airs sans un bruit, comme s’il glissait.\nCe Pokémon s’accroche au visage de son ennemi grâce aux\nserres de ses pattes arrière et aux pinces de ses pattes avant,\net pique avec son dard empoisonné.'),(129,26,'Raichu',0.8,30.0,'Si ses joues sont à court d’énergie, il lève la queue\net capte l’électricité contenue dans l’atmosphère.'),(130,76,'Grolem',1.4,300.0,'Juste après la mue, son corps est blanc et\ntendre. Au contact de l’air, sa peau se solidifie\net forme une armure.'),(131,143,'Ronflex',2.1,460.0,'L’estomac de ce Pokémon est si résistant\nqu’il peut même digérer de la nourriture avariée.'),(132,22,'Rapasdepic',1.2,38.0,'Un Pokémon très ancien. S’il perçoit un danger,\nil fuit instantanément à haute altitude.'),(133,554,'Darumarond',0.6,37.5,'On a beau le pousser ou le tirer, quand il dort,\nrien ne le fait vaciller. Cette qualité lui a valu\nde devenir un emblème pour les porte-bonheurs.'),(134,423,'Tritosor',0.9,29.9,'Son corps est caoutchouteux, mais très résistant,\ncar la puissance des chocs qu’il subit se répand\nsur toute sa surface.'),(135,393,'Tiplouf',0.4,5.2,'Il est fier et déteste accepter la nourriture qu’on lui offre.\nSon pelage épais le protège du froid.'),(136,841,'Pomdrapi',0.3,1.0,'Il vole avec ses ailes faites de pelures de pomme\net crache une substance très acide.\nIl peut aussi prendre la forme de ce fruit.'),(137,563,'Tutankafer',1.7,76.5,'On le voit souvent représenté sur les murs\ndes vieilles sépultures des rois en tant que\nsymbole de leur richesse.'),(138,179,'Wattouat',0.6,7.8,'Il a beau être mignon, sa laine génère de\nl’électricité quand on la frotte. Tentez de le\ncaresser, et il vous mettra vite au courant !'),(139,221,'Cochignon',1.1,55.8,'Bien qu’il soit pourvu de pattes courtes,\nses sabots larges et pointus l’empêchent\nde glisser sur la glace.'),(140,714,'Sonistrelle',0.5,8.0,'Il peut contrôler des ondes à n’importe quelle\nfréquence du spectre. Même les plus grands\nPokémon ne peuvent supporter ses ultrasons.'),(141,769,'Bacabouh',0.5,70.0,'Il vit principalement sur les plages 