ctère agressif et violent lui a valu\nde perdre son rôle de transporteur à Galar\nau profit de Corvaillus.'),(155,43,'Mystherbe',0.5,5.4,'Pendant la journée, il reste en sous-sol et évite\nle soleil. Il grandit en se baignant au clair de lune.'),(156,8,'Carabaffe',1.0,22.5,'Il se sert habilement de sa queue et de ses\noreilles touffues pour garder son équilibre\nsous l’eau.'),(157,158,'Kaiminus',0.6,9.5,'Malgré son tout petit corps, la mâchoire de Kaiminus est\ntrès puissante. Parfois, ce Pokémon mordille les gens pour\njouer, sans se rendre compte que sa morsure peut gravement\nblesser quelqu’un.'),(158,462,'Magnézone',1.2,180.0,'On pense qu’il a évolué après avoir été exposé\nà un champ magnétique particulier qui a modifié\nla structure moléculaire de son corps.'),(159,792,'Lunala',4.0,120.0,'Il capture toute la lumière qui l’entoure pour\nprendre la forme de la pleine lune et éclairer\nles ténèbres nocturnes.'),(160,442,'Spiritomb',1.0,108.0,'Pour punir son comportement déplorable,\nun voyageur a utilisé un mystérieux sortilège\npour l’enchaîner à une Clé de Voûte.'),(161,53,'Persian',1.0,32.0,'Il se comporte avec grâce et élégance,\net ne s’entend pas avec les rustres Berserkatt :\nles deux espèces se méprisent.'),(162,335,'Mangriff',1.3,40.3,'Mangriff est généralement à quatre pattes, mais lorsqu’il\nest en colère, il se lève sur ses pattes arrière et montre\nses griffes. Ce Pokémon est l’ennemi juré de Séviper depuis\nplusieurs générations.'),(163,893,'Zarude',1.8,70.0,'Lorsque ses lianes se détachent de son corps,\nelles fertilisent le sol et favorisent la croissance\ndes plantes de la forêt.'),(164,287,'Parecool',0.8,24.0,'Le cœur de Parecool ne bat qu’une fois par minute.\nQuoi qu’il arrive, il se contente de s’avachir, immobile.\nIl est très rare de voir ce Pokémon se déplacer.'),(165,438,'Manzaï',0.5,15.0,'Il vit dans les zones rocheuses arides.\nQuand ses boules vertes sont sèches,\nelles se mettent à briller légèrement.'),(166,499,'Grotichon',1.0,55.5,'Quand le feu dans son corps s’embrase, sa vitesse et\nson agilité augmentent. En cas d’urgence, il crache de\nla fumée.'),(167,504,'Ratentif',0.5,11.6,'Très prudent, il surveille attentivement son territoire,\nmais oublie souvent de regarder derrière lui.'),(168,344,'Kaorine',1.5,108.0,'Ce Pokémon aurait été créé à partir d’une poupée\nd’argile confectionnée par une ancienne\ncivilisation. Il se déplace en lévitant.'),(169,198,'Cornèbre',0.5,2.1,'Il cherche des objets brillants pour son chef.\nSa réputation d’oiseau de mauvais augure lui\nvaut la haine de nombreuses personnes.'),(170,346,'Vacilys',1.5,60.4,'Il attrape ses proies à l’aide de ses tentacules,\npuis les dissout immédiatement avec ses sucs\ndigestifs pour en absorber les nutriments.'),(171,739,'Crabagarre',0.6,7.0,'Il grimpe parfois sur un Noadkoko qu’il a pris\npour un cocotier. Il se fait alors éjecter puis\npiétiner par le Noadkoko courroucé.'),(172,28,'Sablaireau',1.0,29.5,'Il grimpe aux arbres grâce à ses griffes acérées\net fait tomber des Baies pour les Sabelette\nqui attendent au sol.'),(173,58,'Caninos',0.7,19.0,'Très fidèle, il aboie de toutes ses forces pour\nprotéger son Dresseur d’Origine quand un danger\nle guette.'),(174,42,'Nosferalto',1.6,55.0,'Il se déplace habilement sur ses petites pattes,\ns’approche silencieusement de sa proie endormie,\net lui suce le sang à l’aide de ses crocs.'),(175,780,'Draïeul',3.0,185.0,'Il est d’un naturel sociable et aimable, mais quand\nil se met en colère, il déchaîne des bourrasques\nqui emportent tout sur leur passage.'),(176,190,'Capumain',0.8,11.5,'Il guette ses proies depuis la cime des arbres.\nQuand il aperçoit un Croquine, son mets préféré,\nil se jette dessus.'),(177,195,'Maraiste',1.4,75.0,'Il est toujours gluant. Quand il nage, il se cogne\nsouvent la tête au fond des rivières, mais semble\ns’en moquer.'),(178,17,'Roucoups',1.1,30.0,'Ce Pokémon est très endurant. Il survole\nen permanence son territoire pour chasser.'),(179,215,'Farfuret',0.9,28.0,'Un Pokémon aussi cruel que fourbe.\nIl se glisse dans le nid des autres Pokémon\nen leur absence pour dérober leurs Œufs.'),(180,233,'Porygon2',0.6,32.5,'Depuis qu’on l’a doté d’une intelligence\nartificielle, il parle un langage mystérieux\nque seuls ses congénères comprennent.'),(181,782,'Bébécaille',0.6,29.7,'Il communique avec ses congénères en faisant\ncliqueter ses écailles dures comme du métal.'),(182,868,'Crèmy',0.2,0.3,'Les pâtissiers connaissent tous ce vieil adage :\nQuand Crèmy apparaît, le succès est assuré.'),(183,861,'Angoliath',1.5,61.0,'Ses cheveux sont comme des muscles filandreux\nqu’il peut détacher pour saisir ses adversaires,\ntels des tentacules.'),(184,199,'Roigada',2.0,79.5,'Il est capable de résoudre tous les problèmes\nqu’on lui présente, mais personne ne parvient\nà comprendre ce qu’il dit.'),(185,598,'Noacier',1.0,110.0,'Ses épines sont plus solides que l’acier.\nIl plante celles de ses tentacules dans les parois\nrocheuses pour se déplacer.'),(186,275,'Tengalice',1.3,59.6,'Il vit caché au fond des forêts.\nOn raconte qu’il fait souffler la bise\nlorsqu’il agite ses grands éventails.'),(187,59,'Arcanin',1.9,155.0,'Ce Pokémon est admiré depuis toujours pour\nsa beauté. Il court avec tellement de légèreté\nqu’on dirait qu’il vole.'),(188,386,'Deoxys',1.7,60.8,'Deoxys était à l’origine un virus provenant de l’espace. Il est\nextrêmement intelligent et dispose de pouvoirs télékinétiques.\nCe Pokémon envoie des lasers avec l’organe cristallin situé\nsur sa poitrine.'),(189,133,'Évoli',0.3,6.5,'L’ADN de ce Pokémon très particulier recèle\nde nombreuses possibilités d’évolution.'),(190,509,'Chacripan',0.4,10.1,'Malheur à qui se laisse berner par ses gestes\nadorables : une fois les gens à sa portée,\nil les griffe sans crier gare, en ricanant.'),(191,672,'Cabriolaine',0.9,31.0,'Tant qu’il a de l’eau et du soleil en abondance,\nce Pokémon n’a pas besoin de nourriture. Les feuilles\nsur son dos produisent son énergie par photosynthèse.'),(19