é Balls.'),(205,66,'Machoc',0.8,19.5,'Il essaie de dépenser son énergie débordante\nen soulevant des rochers, ce qui le rend encore\nplus fort.'),(206,544,'Scobolide',1.2,58.5,'Il se protège avec sa solide carapace et ses épines\nempoisonnées tandis qu’il rassemble l’énergie\nnécessaire à son évolution.'),(207,516,'Flotoutan',1.0,29.0,'Il aime les endroits où l’eau est pure. Il se ravitaille en eau\nen l’aspirant avec sa queue.'),(208,40,'Grodoudou',1.0,12.0,'Sa fourrure soyeuse fait sa fierté. La touffe\nsur son front est si douce que la caresser\ndonne l’impression d’être sur un petit nuage.'),(209,761,'Croquine',0.3,3.2,'La sueur sucrée qu’il produit lorsqu’on l’attaque\nest délicieuse. L’odeur de celle-ci lui attire encore\nplus d’ennemis.'),(210,176,'Togetic',0.6,3.2,'Ce Pokémon est capable de léviter sans battre\ndes ailes. Il est vite démoralisé s’il n’est pas\nen compagnie de gens sympathiques.'),(211,680,'Dimoclès',0.8,4.5,'Ses deux lames abattent leurs proies\nen enchaînant les attaques et les parades\nà un rythme effréné.'),(212,342,'Colhomard',1.1,32.8,'Il adore se battre et frappe comme une brute\ntous ceux qui approchent de sa mare.'),(213,205,'Foretress',1.2,125.8,'On ne peut voir l’intérieur de sa carapace que\nlorsqu’il engloutit sa nourriture, mais il est si\nrapide que personne n’a encore jamais réussi.'),(214,52,'Miaouss',0.4,4.2,'Tatillon sur la propreté de la pièce sur son front,\nil se lave la figure avec grand soin. Il ne s’entend\npas avec les Miaouss de Galar.'),(215,73,'Tentacruel',1.6,55.0,'Il peut allonger ses 80 tentacules à volonté et\nles utiliser comme un filet pour attraper sa proie\net la transpercer de ses pics empoisonnés.'),(216,561,'Cryptéro',1.4,14.0,'En fouillant sous le sable du désert survolé\npar Cryptéro, on a retrouvé les vestiges\nde ce que l’on croit être une ville antique.'),(217,425,'Baudrive',0.4,1.2,'Nés d’une concentration d’âmes, ces Pokémon\npeuvent apparaître en grand nombre les jours\noù le taux d’humidité est