ettes. Il se bat avec sa colonie pour protéger\nses Œufs des attaques des Dunaconda.'),(243,377,'Regirock',1.7,230.0,'Bien que son corps de pierre ait été examiné\navec les technologies les plus modernes, nulle\ntrace de cerveau ou de cœur n’a été trouvée.'),(244,713,'Séracrawl',2.0,505.0,'Les crevasses sur son dos s’approfondissent\nau cours de la journée, mais se comblent\nde nouveau pendant la nuit.'),(245,662,'Braisillon',0.7,16.0,'De nature belliqueuse, il dispose d’un fort\ninstinct territorial. Quand il chasse, il se dispute\nrégulièrement les proies avec ses congénères.'),(246,621,'Drakkarmin',1.6,139.0,'Féroce et perfide, Drakkarmin s’approprie\nles terriers creusés par d’autres Pokémon\npour en faire son antre.'),(247,785,'Tokorico',1.8,20.5,'Il est le gardien de Mele-Mele et le maître\nde la foudre. D’un naturel curieux, il apparaît\ndevant les humains de temps à autre.'),(248,322,'Chamallot',0.7,24.0,'Chamallot stocke du magma à 1 200 °C dans son corps.\nLorsqu’il est mouillé, le magma se refroidit et durcit. Le corps\ndu Pokémon devient alors très lourd et ses mouvements\ntrès lents.'),(249,363,'Obalie',0.8,39.5,'Il scrute la mer en se laissant porter par\nles vagues. Lorsqu’il repère des proies,\nil avertit les Kaimorse du groupe.'),(250,744,'Rocabot',0.5,9.2,'Il intimide ses ennemis en cognant les rochers\nautour de son cou contre le sol. Au premier\nsigne de faiblesse, il passe à l’assaut.'),(251,690,'Venalgue',0.5,7.3,'Ressembler à une algue en décomposition lui\npermet d’échapper à ses ennemis en se cachant\nau milieu des résidus de plantes aquatiques.'),(252,528,'Rhinolove',0.9,10.5,'Certaines contrées le vénèrent et pensent\nque la forme de son nez est un symbole\nde chance et de bonheur.'),(253,525,'Géolithe',0.9,102.0,'Il sonde les environs grâce au son. Lorsqu’un\nimportun le met en colère, il se lance à sa\npoursuite sans changer l’orientation de son corps.'),(254,265,'Chenipotte',0.3,3.6,'Chenipotte est la proie de Hélédelle. Ce Pokémon essaie de\nrésister en dirigeant les pointes de son dos vers le prédateur.\nIl affaiblit son ennemi en lui injectant du poison.'),(255,18,'Roucarnage',1.5,39.5,'Ce Pokémon vole à Mach 2 quand il chasse.\nSes grandes serres sont des armes redoutables.'),(256,60,'Ptitard',0.6,12.4,'Dans les rivières au courant puissant, il se sert\nde ses lèvres épaisses comme d’une ventouse\npour s’accrocher aux rochers.'),(257,379,'Registeel',1.9,205.0,'Il paraît qu’il est né dans le manteau terrestre\net qu’il en a émergé il y a environ 10 000 ans.'),(258,244,'Entei',2.1,198.0,'Entei incarne la colère du magma. On pense que ce\nPokémon est né suite à l’éruption d’un volcan. Il peut\nenvoyer d’énormes jets de flammes qui calcinent tout\nce qu’ils touchent.'),(259,529,'Rototaupe',0.3,8.5,'Les cultivateurs le détestent, car il abîme leurs\nlégumes en creusant la terre avec ses griffes.'),(260,879,'Pachyradjah',3.0,650.0,'Ces Pokémon vivent en troupeau.\nL’étreinte de leur trompe est si forte qu’elle suffit\nà réduire un rocher en poussière.'),(261,263,'Zigzaton',0.4,17.5,'Le Zigzaton de Galar a adopté cette forme\ndans les autres régions.\nIl est très doué pour dénicher des choses.'),(262,186,'Tarpaud',1.1,33.9,'Le cri des mâles est plus puissant que celui\ndes femelles, qui préfèrent les voix fortes\net intimidantes.'),(263,399,'Keunotor',0.5,20.0,'Il ronge constamment des troncs et des pierres pour se faire\nles incisives. Il niche le long de l’eau.'),(264,164,'Noarfang',1.6,40.8,'Quand il réfléchit, il tourne sa tête sur 180 degrés\npour optimiser son mode de pensée.'),(265,234,'Cerfrousse',1.4,71.2,'Les superbes bois de Cerfrousse étaient vendus très cher\ncomme œuvres d’art. Ce Pokémon fut chassé et l’espèce\nproche de l’extinction à cause des gens qui recherchaient\nleurs précieux bois.'),(266,171,'Lanturn',1.2,22.5,'Il dégage une vive lumière pour éblouir ses proies,\npuis leur inflige un choc électrique bien senti.'),(267,159,'Crocrodil',1.1,25.0,'Une fois que Crocrodil a refermé 