\npuissants. Il tape contre les arbres à raison\nde seize coups de bec par seconde.'),(308,136,'Pyroli',0.9,25.0,'Il emmagasine de l’air dans sa poche de flammes\net le chauffe à une température de 1 700 °C.'),(309,483,'Dialga',5.4,683.0,'Il peut contrôler le temps. Les mythes de Sinnoh en parlent\ncomme d’une divinité ancienne.'),(310,629,'Vostourno',0.5,9.0,'Il grandit vite. Au sein du nid, les petits Vostourno\nhéritent des couches en crâne de leurs aînés.'),(311,206,'Insolourdo',1.5,14.0,'Bien que son nid ressemble à un labyrinthe,\nil ne s’y perd jamais, car il se repère grâce\nà l’odeur de la terre.'),(312,865,'Palarticho',0.8,117.0,'Il pare les attaques avec le tranchant de son\nsolide poireau, et contre-attaque avec la pointe\nde la tige. Son arme est également comestible.'),(313,248,'Tyranocif',2.0,202.0,'Son pas est si lourd qu’il fait trembler le sol\net s’écrouler même les plus grandes montagnes,\nce qui altère la topographie de la zone.'),(314,210,'Granbull',1.4,48.7,'Les jeunes gens en sont fous, mais sa timidité\net sa grande délicatesse en font un piètre\nPokémon de garde.'),(315,854,'Théffroi',0.1,0.2,'Il élit domicile dans des tasses de thé anciennes\nde grand renom. Parmi celles-ci se trouvent\nde nombreuses contrefaçons.'),(316,49,'Aéromite',1.5,12.5,'Les écailles de ses ailes sont presque impossibles\nà retirer lorsqu’elles se collent à la peau,\net elles libèrent un poison violent au contact.'),(317,492,'Shaymin',0.2,2.1,'Il prend son essor pour répandre la gratitude lorsque\nles Gracidées fleurissent.'),(318,859,'Grimalin',0.4,5.5,'Il se glisse dans les foyers pour commettre\nun larcin et en profite pour se nourrir de l’énergie\nnégative des habitants contrariés.'),(319,679,'Monorpale',0.8,2.0,'L’œil bleu sur la garde de la lame est le véritable\ncorps de Monorpale. Il aspire l’énergie vitale\ndes gens avec son étoffe usée par le temps.'),(320,615,'Hexagel',1.1,148.0,'Lorsqu’il fait trop chaud, il s’évapore, ce qui\nexplique pourquoi on ne le 