u',0.9,19.5,'Galifeu combat grâce aux flammes ardentes qu’il crache\nde son bec et à ses coups de pied destructeurs.\nLe cri de ce Pokémon est très puissant et très gênant\npour l’adversaire.'),(358,470,'Phyllali',1.0,25.5,'Grâce à sa queue aussi effilée qu’une lame, il est\ncapable de fendre en deux des arbres immenses.'),(359,271,'Lombre',1.2,32.5,'Il vit au bord de l’eau dans les endroits\nensoleillés. Il s’endort sur un tas d’algues\ndans la journée et ne se lève qu’à la nuit tombée.'),(360,192,'Héliatronc',0.8,8.5,'Héliatronc convertit l’énergie solaire en nutriments. Il remue\nactivement pendant la journée, quand il fait chaud. Il redevient\nimmobile dès que le soleil se couche.'),(361,348,'Armaldo',1.5,68.2,'Bien que vivant sur la terre ferme, il est très\nbon nageur. Il plonge dans la mer à la recherche\nde proies et les abat avec ses pinces acérées.'),(362,603,'Lampéroie',1.2,22.0,'Un Pokémon doté d’un gros appétit. Il paralyse ses proies\navec des décharges électriques avant de les manger.'),(363,501,'Moustillon',0.5,5.9,'Il combat avec le coupillage de son ventre. Il peut parer\nun assaut et immédiatement contre-attaquer.'),(364,343,'Balbuto',0.5,21.5,'Ce Pokémon découvert dans des ruines anciennes\ntourne sur lui-même pour se déplacer. Il se tient\ntoujours sur un pied, même quand il dort.'),(365,831,'Moumouton',0.6,6.0,'Si ses poils poussent trop, il ne peut plus bouger.\nLes étoffes tissées avec son pelage\nsont étonnamment solides.'),(366,396,'Étourmi',0.3,2.0,'Ce Pokémon très bruyant parcourt champs et forêts en nuées\npour chasser les Pokémon Insecte.'),(367,568,'Miamiasme',0.6,31.0,'Il est né d’un sac poubelle rempli d’ordures.\nLe gaz empoisonné qu’il exhale est très apprécié\ndes Smogogo de Galar.'),(368,301,'Delcatty',1.1,32.6,'Delcatty peut dormir n’importe où. Il n’a pas de nid\npermanent. Lorsque d’autres Pokémon lui cherchent\ndes noises pendant son sommeil, il ne répond pas et\nse contente de partir dormir ailleurs.'),(369,753,'Mimantis',0.