ique pour récupérer le pollen des fleurs. Ce Pokémon\nse laisse porter par les vents printaniers pendant qu’il butine.'),(431,636,'Pyronille',1.1,28.8,'La température de son corps est très élevée.\nIl projette des flammes du bout de ses cornes\npour intimider ses ennemis et ses proies.'),(432,817,'Arrozard',0.7,11.5,'Paresseux, mais malin, il parsème son territoire\nde pièges pour empêcher ses ennemis\nd’y pénétrer.'),(433,302,'Ténéfix',0.5,11.0,'Ce Pokémon se nourrit de pierres précieuses.\nDans les ténèbres, ses yeux brillent du reflet\ndes joyaux.'),(434,698,'Amagara',1.3,25.2,'Un Pokémon ancien qui s’est éteint. On trouve\nparfois des spécimens conservés dans la glace.'),(435,608,'Mélancolux',0.6,13.0,'Il se cache en ville en se faisant passer pour\nun lampadaire. Lorsqu’il repère une personne\ndont l’heure est proche, il la suit en catimini.'),(436,646,'Kyurem',3.0,325.0,'Il se serait congelé lui-même avec son souffle\nglacé pour stabiliser sa structure cellulaire.'),(437,354,'Branette',1.1,12.5,'Il est né de la rancune qu’il a ressentie quand\nil a été abandonné. Il redevient apparemment\nune poupée si l’on en prend grand soin.'),(438,35,'Mélofée',0.6,7.5,'Son comportement et son cri adorables font de\nlui un Pokémon très populaire. Malheureusement,\nil est difficile d’en croiser un spécimen.'),(439,667,'Hélionceau',0.6,13.5,'Il déborde d’énergie et de curiosité. Quand\nil se fâche ou qu’il s’apprête à se battre,\nsa courte crinière s’échauffe.'),(440,80,'Flagadoss',1.6,78.5,'La morsure du Kokiyas l’a tellement surpris\nqu’il est devenu bipède. Il paraît qu’il redevient\nun Ramoloss si le Kokiyas lâche prise.'),(441,555,'Darumacho',1.3,92.9,'Sa puissance augmente à mesure que la flamme\nde son corps s’intensifie. La température\nde celle-ci peut parfois dépasser les 1 400 °C.'),(442,500,'Roitiflam',1.6,150.0,'Il a une barbe enflammée. Il maîtrise des techniques\nde combat au corps à corps rapides et puissantes.'),(443,482,'Créfadet',0.3,0.3,'On raconte que Créhelf, Créfollet et Créfadet proviennent\ndu même Œuf.'),(444,406,'Rozbouton',0.2,1.2,'Il est sensible aux variations de température.\nQuand son bourgeon commence à s’ouvrir,\nl’arrivée du printemps est imminente.'),(445,763,'Sucreine',1.2,21.4,'Ce Pokémon frappe violemment ses ennemis\nde la pointe dure de ses jambes, ce qui leur inflige\ndes dégâts irréversibles au corps et à l’âme.'),(446,587,'Emolga',0.4,5.0,'Les Baies sucrées sont son péché mignon.\nIl lui arrive d’en conserver beaucoup trop dans\nses bajoues, ce qui l’empêche de bien planer.'),(447,358,'Éoko',0.6,1.0,'Lorsqu’il y a beaucoup de vent, Éoko pousse des cris,\naccroché à une branche ou à un auvent par une ventouse\nplacée sur sa tête. Ce Pokémon attrape des Baies avec\nsa longue queue pour les manger.'),(448,682,'Fluvetin',0.2,0.5,'Une douce odeur qui charme les gens émane\nde son corps. Les dames nobles raffolaient de lui.'),(449,767,'Sovkipou',0.5,12.0,'Ils se déplacent en groupe, toujours en alerte.\nDès qu’ils détectent une présence ennemie,\nils s’enfuient dans toutes les directions.'),(450,851,'Scolocendre',3.0,120.0,'Il est de nature agressive. Non seulement\nson corps brûlant est dangereux, mais il possède\nen plus d’énormes crocs très pointus.'),(451,214,'Scarhino',1.5,54.0,'Ce Pokémon est fier de sa force colossale\nqui lui permet de soulever cent fois son propre\npoids avec facilité.'),(452,860,'Fourbelin',0.8,12.5,'La nuit, il ruse pour attirer ses proies dans la forêt.\nOn raconte qu’il a le pouvoir de faire pousser\nles cultures agricoles.'),(453,534,'Bétochef',1.4,87.0,'Quand il décide de passer aux choses sérieuses,\nil jette ses piliers de béton et saute sur\nson adversaire pour le frapper du poing.'),(454,665,'Pérégrain',0.3,8.4,'Même les becs acérés des Pokémon Oiseaux ne parviennent\npas à meurtrir son corps très dur. Il se défend en crachant\nde la poudre.'),(455,4,'Salamèche',0.6,8.5,'Depuis sa naissance, une petite flamme brûle\nau bout de sa queue. Si cette flamme s’éteint,\n