elles font dépérir les arbres\net les herbes.'),(480,606,'Neitram',1.0,34.5,'Il peut manipuler les souvenirs de son adversaire\nà loisir. Parfois, on l’aperçoit en train de\nvagabonder au-dessus des champs de blé.'),(481,134,'Aquali',1.0,29.0,'Sa structure cellulaire est similaire à la composition\nmoléculaire de l’eau. Une fois dans cet élément,\nil devient indétectable à l’œil nu.'),(482,567,'Aéroptéryx',1.4,32.0,'Il savait voler, mais il semble qu’il était beaucoup\nplus doué pour chasser ses proies sur la terre\nferme.'),(483,872,'Frissonille',0.3,3.8,'Il se nourrit de la neige entassée sur le sol.\nPlus il en mange, plus les épines sur son dos\ngrandissent.'),(484,30,'Nidorina',0.8,20.0,'Si un danger menace le groupe, ces Pokémon\nse réunissent et l’affrontent en émettant\ndes ultrasons en chœur.'),(485,873,'Beldeneige',1.3,42.0,'Sans pitié pour les vandales, il bat ses ailes\ngelées pour provoquer des blizzards et punir\nquiconque ose souiller les champs et les collines.'),(486,839,'Monthracite',2.8,310.5,'Lorsqu’il s’engage dans un combat, son tas\nde charbon brûle et vire au rouge, ce qui répand\nde petites étincelles qui calcinent ce qui l’entoure.'),(487,13,'Aspicot',0.3,3.2,'L’aiguillon sur son front est très pointu.\nIl se cache dans les bois et les hautes herbes,\noù il se gave de feuilles.'),(488,549,'Fragilady',1.1,16.3,'L’huile essentielle extraite de sa fleur dégage\nun parfum exceptionnel, mais elle coûte\nextrêmement cher.'),(489,574,'Scrutella',0.4,5.8,'Parfois, ce Pokémon chuchote alors qu’il n’y a\npersonne aux alentours. On raconte qu’il parle\nà une entité que personne ne peut voir.'),(490,625,'Scalproie',1.6,70.0,'Sa recherche des meilleurs endroits où trouver\ndes pierres pour affûter ses lames le conduit\nsouvent à affronter des Incisache.'),(491,122,'M. Mime',1.3,54.5,'Son talent pour le mime est indéniable.\nIl émet des ondes du bout des doigts pour créer\nun mur qui le protège de nombreuses attaques.'),(492,450,'Hippodocus',2.0,300.0,'I