 un Pokémon solitaire. Un seul coup de ses puissantes\nailes peut briser un arbre en deux.'),(518,466,'Élekable',1.8,138.6,'La quantité d’électricité qu’il génère est énorme,\nmême pour un Pokémon Électrik. Il inflige de\nfortes décharges du bout de ses queues.'),(519,235,'Queulorior',1.2,58.0,'Il se sert du liquide qui sort de sa queue pour\ndessiner sa marque. Ses fans s’arrachent ses\nplus beaux tracés à prix d’or.'),(520,706,'Muplodocus',2.0,150.5,'Il attaque à l’aide de ses longues cornes.\nSes coups sont cent fois plus puissants\nque ceux d’un champion poids lourds de boxe.'),(521,184,'Azumarill',0.8,28.5,'Il crée des bulles d’air dont il enveloppe\ngentiment les Azurill venus jouer dans la rivière.'),(522,211,'Qwilfish',0.5,3.9,'Ses petites épines étaient autrefois des écailles.\nElles sécrètent des toxines pouvant faire\nperdre connaissance.'),(523,505,'Miradar',1.1,27.0,'Il attaque en crachant les graines des Baies qu’il accumule\ndans ses bajoues. S’il voit un ennemi, il dresse la queue.'),(524,605,'Lewsor',0.5,9.0,'Ce Pokémon a été découvert il y a environ 50 ans.\nSon cerveau surdéveloppé lui permet d’utiliser\nses pouvoirs psychiques avec aisance.'),(525,883,'Hydragla',2.0,175.0,'Aucune attaque ne pouvait égratigner la peau\nde son visage, mais il s’est éteint, car il avait\ndu mal à respirer.'),(526,858,'Sorcilence',2.1,5.1,'On l’appelle aussi la « sorcière de la forêt ».\nCe Pokémon lacère quiconque fait trop de bruit\navec les griffes de son tentacule.'),(527,230,'Hyporoi',1.8,152.0,'Les écailles qui se détachent de son corps\nbrillent d’un éclat si élégant et si intense\nqu’on les offre aux familles royales.'),(528,700,'Nymphali',1.0,23.5,'Un conte de Galar relate la victoire d’un beau\nNymphali sur un terrible Pokémon Dragon.'),(529,77,'Ponyta',1.0,30.0,'Il semblerait qu’une fois qu’un Dresseur a gagné\nla confiance de Ponyta, sa crinière enflammée\nne le brûle plus au toucher.'),(530,165,'Coxy',1.0,10.8,'Extrêmement timide, ce Pokémon défend le ni