'),(556,543,'Venipatte',0.4,5.3,'Ses crocs sont extrêmement venimeux.\nDès qu’il voit une proie à son goût, il bondit\nsur elle sans penser aux conséquences.'),(557,895,'Regidrago',2.1,200.0,'Son corps est entièrement composé de cristaux\nd’énergie draconique. Il possèderait les pouvoirs\nde tous les Pokémon Dragon.'),(558,432,'Chaffreux',1.0,43.8,'Il ceinture sa taille de sa queue bifide pour paraître\nplus imposant.'),(559,765,'Gouroutan',1.5,76.0,'Il connaît la forêt sur le bout des doigts.\nLorsqu’il trouve un Pokémon blessé, il cherche\ndes plantes médicinales pour le soigner.'),(560,280,'Tarsal',0.4,6.6,'Quand ses cornes rouges captent les ondes\npositives d’un Pokémon ou d’un humain,\ntout son corps se réchauffe.'),(561,365,'Kaimorse',1.4,150.6,'Ses défenses poussent tout au long de sa vie.\nSi l’une d’elles se brise au cours d’un combat,\nau bout d’un an, elle aura repoussé entièrement.'),(562,514,'Flamoutan',1.0,28.0,'Quand il est excité, des flammèches brûlantes dansent\nsur sa tête et sa queue. Il raffole des choses sucrées.'),(563,626,'Frison',1.6,94.6,'Les Frison vivent en troupeau d’une vingtaine\nd’individus. Pour une raison inconnue, si l’un\nd’eux trahit le groupe, il perd sa crinière.'),(564,303,'Mysdibule',0.6,11.5,'Ses cornes d’acier forment une grande mâchoire\navec laquelle il mord férocement ses adversaires.'),(565,24,'Arbok',3.5,65.0,'Des études ont révélé que les marques\neffrayantes de son corps pouvaient former\nsix motifs différents.'),(566,836,'Fulgudog',1.0,34.0,'Il se sert de l’énergie électrique pour augmenter\nla puissance de ses membres.\nSa vitesse maximale dépasse de peu les 90 km/h.'),(567,562,'Tutafeh',0.5,1.5,'Il est né de l’âme d’un être humain d’un peuple\nantique. Il erre dans les ruines à la recherche\nde quiconque reconnaîtra son visage.'),(568,635,'Trioxhydre',1.8,160.0,'Chacune de ses trois têtes mord à tour de rôle.\nIl attaque ses adversaires sans relâche,\njusqu’à ce qu’ils s’écroulent.'),(569,98,'Krabby',0.4,6.5,'S’il se sent menacé, il se cache derrière les bulles\némises par sa bouche pour paraître plus gros.'),(570,139,'Amonistar',1.0,35.0,'Ses crocs sont capables de broyer la roche,\nmais il ne peut s’attaquer qu’aux proies\nà portée de ses tentacules.'),(571,242,'Leuphorie',1.5,46.8,'Il pond d’étranges œufs remplis de bonheur.\nOn raconte que quiconque en mange un\ndevient aimable envers tout le monde.'),(572,824,'Larvadar',0.4,8.0,'On le voit souvent dans les champs.\nLes poils de son corps lui servent à capter\nce qu’il se passe autour de lui.'),(573,390,'Ouisticram',0.5,6.2,'La flamme de son postérieur brûle grâce à un gaz de son\nestomac. Elle faiblit quand il ne va pas bien.'),(574,897,'Spectreval',2.0,44.5,'Ce Pokémon friand de silence et de solitude\ngalope à travers les ténèbres nocturnes\net aspire l’énergie vitale des êtres endormis.'),(575,875,'Bekaglaçon',1.4,89.0,'Ne supportant pas la chaleur, il se rafraîchit\ntoujours la tête avec de la glace.\nIl pêche de quoi se nourrir à l’aide de son cheveu.'),(576,652,'Blindépique',1.6,90.0,'Il se défend en joignant ses poings devant son visage.\nDans cette posture, il peut même résister à l’onde de choc\nd’une explosion.'),(577,806,'Pierroteknik',1.8,13.0,'Cette Ultra-Chimère sortie d’une Ultra-Brèche\nprovoque des explosions pour surprendre\nl’ennemi et en profite pour voler son énergie.'),(578,202,'Qulbutoké',1.3,28.5,'Il vit discrètement dans l’obscurité pour cacher\nsa queue noire. Il n’attaque jamais en premier.'),(579,227,'Airmure',1.7,50.5,'Ce Pokémon orne souvent les blasons,\ncar les plumes qu’il perd sont utilisées\npour forger des épées.'),(580,638,'Cobaltium',2.1,250.0,'Dès la naissance, il a un air de chef.\nMême le plus terrible des adversaires file doux\nface à lui.'),(581,313,'Muciole',0.7,17.7,'La queue de Muciole éclaire comme une ampoule.\nEnsemble, les Muciole dessinent des figures géométriques\ndans la nuit étoilée. Ce Pokémon adore le parfum dégagé\npar Lumivole.'),(582,749,'Tiboudet',1.0,110.0,'Il mâche de la terre pour créer une boue dont\nil s’enduit les jambes. Celle-ci lui permet alors\nd’arpenter même les routes accidentées.'),(583,592,'Viskuse',1.2,33.0,'Certaines légendes racontent que les Viskuse\nsont les habitants d’une ancienne cité engloutie\nqui ont été changés en Pokémon.'),(584,566,'Arkéapti',0.5,9.5,'On dit que c’est l’ancêtre des Pokémon oiseaux.\nIl vivait à la cime des arbres et se nourrissait de\nBaies et de Pokémon Insecte.'),(585,552,'Escroco',1.0,33.4,'Bien que ses yeux particuliers lui permettent\nde voir dans l’obscurité, les nuits sont si froides\ndans le désert qu’il ne se déplace presque pas.'),(586,498,'Gruikui',0.5,9.9,'Il adore se goinfrer de Baies grillées, mais il lui arrive\nde les réduire en cendres dans son excitation.'),(587,614,'Polagriffe',2.6,260.0,'Il sillonne les mers glaciales avec aisance.\nQuand il est fatigué, il gèle l’eau de mer\nd’un souffle et se repose sur l’iceberg improvisé.'),(588,223,'Rémoraid',0.6,12.0,'À l’aide de sa nageoire dorsale en forme\nde ventouse, il s’accroche sous un Démanta\npour récupérer ses restes.'),(589,140,'Kabuto',0.5,11.5,'On raconte qu’ils se seraient éteints,\nmais apparemment, on peut souvent\nen croiser dans une zone particulière.'),(590,899,'Cerbyllin',1.8,95.1,''),(591,898,'Sylveroy',1.1,7.7,'Ce roi légendaire qui a régné sur Galar il y a fort\nlongtemps possède le pouvoir d’apaiser les cœurs\net de faire germer les plantes.'),(592,262,'Grahyèna',1.0,37.0,'Les Grahyèna vivent et se déplacent en meute.\nLeurs réminiscences de la vie sauvage les poussent à n’obéir\nqu’aux Dresseurs qu’ils considèrent comme réellement\ntalentueux.'),(593,417,'Pachirisu',0.4,3.9,'Il arrive que deux Pachirisu se frottent les joues pour partager\nl’électricité qu’ils ont accumulée.'),(594,570,'Zorua',0.7,12.5,'Il lui arrive de se changer en être humain,\nsurtout en enfant, pour venir chercher\nde la nourriture en ville.'),(595,826,'Astronelle',0.4,40.8,'Il déploie ses pouvoirs psychiques pour sonder\nles alentours, sur un rayon pouvant atteindre\n10 km.'),(596,175,'Togepi',0.3,1.5,'C’est un symbole de chance.\nOn dit que sa coquille est remplie de joie.'),(597,434,'Moufouette',0.4,19.2,'S’il lève la queue, c’est qu’il s’apprête à projeter\nun liquide tellement nauséabond qu’il peut faire\nperdre connaissance.'),(598,209,'Snubbull',0.6,7.8,'Malgré les apparences, c’est un grand timide\nqui fait souvent l’objet de railleries quand il se\ntrouve au milieu d’un groupe de Pokémon Chiot.'),(599,481,'Créfollet',0.3,0.3,'Il dort au fond d’un lac. On dit que son esprit abandonne\nson corps pour voler à sa surface.'),(600,489,'Phione',0.4,3.1,'Ce Pokémon des mers chaudes revient toujours à son lieu\nde naissance, peu importe la distance.'),(601,640,'Viridium',2.0,200.0,'Rapide comme le vent, il s’abat tel un tourbillon\nsur ses ennemis avant de les transpercer sans pitié\nde ses cornes acérées.'),(602,84,'Doduo',1.4,39.2,'Ses petites ailes ne lui permettent pas de voler,\nmais grâce à ses puissantes pattes, il peut courir\ntrès rapidement.'),(603,121,'Staross',1.1,80.0,'Il aspire du plancton quand il nage dans la mer\nen faisant tourner son corps à grande vitesse.'),(604,553,'Crocorible',1.5,96.3,'Il aime la violence, mais sait aussi se montrer\npatient lorsqu’il doit passer plusieurs jours\ndans le sable à attendre une proie.'),(605,518,'Mushana',1.1,60.5,'Il est sans cesse assoupi, plongé dans ses rêves.\nIl vaut mieux éviter de le déranger, car il est\ntoujours mal luné au réveil.'),(606,405,'Luxray',1.4,42.0,'Il dort beaucoup pour récupérer la quantité\nd’énergie électrique énorme qu’il consomme\nafin de voir à travers la matière.'),(607,820,'Rongrigou',0.6,6.0,'On rencontre souvent ce Pokémon à Galar.\nAucune coquille de Baie ne résiste à ses incisives,\ndont il est très fier.'),(608,467,'Maganon',1.6,68.0,'Au fil du temps, son corps est devenu similaire\nà un volcan, et un de ses organes ressemble\ndésormais à une chambre magmatique.'),(609,813,'Flambino',0.3,4.5,'Quand il est prêt à se battre, la partie\nqui surmonte son museau ainsi que les coussinets\nde ses pattes postérieures émettent de la chaleur.'),(610,369,'Relicanth',1.0,23.4,'Découvert lors d’une expédition dans les abysses,\nson apparence inchangée depuis 100 millions\nd’années lui a valu le surnom de « fossile vivant ».'),(611,178,'Xatu',1.5,15.0,'Capable de voir le passé et l’avenir, ce Pokémon\nmystérieux consacre toutes ses journées\nà observer la course du soleil.'),(612,440,'Ptiravi',0.6,24.4,'Il prête volontiers son caillou rond à ceux\nqu’il apprécie, mais éclate en sanglots et\nse met en colère si on ne le lui rend pas.'),(613,650,'Marisson',0.4,9.0,'Sa tête et son dos sont recouverts d’une carapace tellement\ndure que même une collision avec un camion ne lui ferait rien.'),(614,7,'Carapuce',0.5,9.0,'S’il se sent menacé, il rétracte ses pattes dans\nsa carapace pour se protéger et crache de l’eau.'),(615,752,'Tarenbulle',1.8,82.0,'Il prend soin de petits Araqua en les abritant\ndans sa bulle et en les laissant grignoter\nles restes de ses repas.'),(616,330,'Libégon',2.0,82.0,'On l’appelle « l’esprit du désert », car ses\nbattements d’ailes résonnent comme une mélodie\nentonnée par une voix douce.'),(617,82,'Magnéton',1.0,60.0,'Il émet constamment une énergie magnétique\npuissante qui interfère avec la grande majorité\ndes ordinateurs dont il s’approche.'),(618,420,'Ceribou',0.4,3.3,'Plus son corps est rouge, plus la saveur\nde sa petite boule gorgée de nutriments\nest sucrée et délicieuse.'),(619,25,'Pikachu',0.4,6.0,'Les Pikachu se disent bonjour en se frottant\nla queue et en y faisant passer du courant\nélectrique.'),(620,29,'Nidoran♀',0.4,7.0,'Ce Pokémon se nourrit de Baies en les ouvrant\navec ses incisives. Le bout de sa corne est plus\narrondi que celui du mâle.'),(621,479,'Motisma',0.3,0.3,'Son corps composé de plasma lui permet\nd’infiltrer diverses machines.\nIl adore surprendre les gens.'),(622,458,'Babimanta',1.0,65.0,'Il nage au sein des bancs de Rémoraid.\nLorsqu’un prédateur les attaque, il se bat\nà leurs côtés.'),(623,852,'Poulpaf',0.6,4.0,'Il a l’intelligence d’un enfant de trois ans.\nIl perd souvent ses tentacules, mais comme\nils repoussent, il ne s’en soucie guère.'),(624,669,'Flabébé',0.1,0.1,'Bien qu’il soit vulnérable sans le pouvoir\nde sa fleur, il voyagera jusqu’à en trouver\nune de la couleur et de la forme qu’il préfère.'),(625,141,'Kabutops',1.3,40.5,'Nul ne sait pourquoi il s’est éteint.\nCe Pokémon préhistorique féroce\nvivait dans les mers chaudes.'),(626,412,'Cheniti',0.2,3.4,'S’il perd sa cape au combat, il en tisse rapidement\nune nouvelle avec ce qui lui tombe sous la main.'),(627,91,'Crustabri',1.5,132.5,'Quand il referme sa coquille, il est impossible de\nla rouvrir, même avec une force hors du commun.'),(628,316,'Gloupti',0.4,10.3,'Le corps de Gloupti n’est pratiquement qu’un gros estomac.\nEn comparaison, son cœur et son cerveau sont tout petits.\nL’estomac de ce Pokémon contient des enzymes spéciales\ncapables de tout dissoudre.'),(629,874,'Dolman',2.5,520.0,'Tous les ans à la même date, ils arrivent\nde nulle part pour se réunir en cercle.\nC’est une de leurs coutumes.'),(630,888,'Zacian',2.8,110.0,'On dit qu’il s’agit de la figure fraternelle\net du rival de Zamazenta, un Pokémon plongé\ndans un long sommeil.'),(631,811,'Badabouin',0.7,14.0,'Il est tellement concentré à battre à un rythme\neffréné que même lorsque son adversaire\ntombe K.O., il ne s’en rend pas compte.'),(632,722,'Brindibou',0.3,1.5,'Pendant la journée, il emmagasine de l’énergie\npar photosynthèse. La nuit, il plane\nsilencieusement à la recherche de proies.'),(633,689,'Golgopathe',1.3,96.0,'Il scrute les environs avec les yeux de ses paumes.\nEn cas d’urgence, ses membres peuvent prendre\ndes initiatives pour triompher de l’ennemi.'),(634,231,'Phanpy',0.5,33.5,'Phanpy utilise sa petite trompe pour se doucher.\nQuand plusieurs d’entre eux se réunissent, ils s’arrosent\njoyeusement. On peut souvent voir