st très doué pour trouver des Baies et aime les partager\navec ses amis sans rien demander en échange.'),(649,183,'Marill',0.4,8.5,'Sa fourrure est hydrophobe, si bien qu’elle\nsèche en un instant. Il n’a donc jamais froid,\nmême lorsqu’il sort d’une mer glaciale.'),(650,656,'Grenousse',0.3,7.0,'Il protège son corps en l’entourant d’une mousse délicate.\nMalgré son apparence insouciante, ce Pokémon est en fait\nconstamment à l’affût.'),(651,443,'Griknot',0.7,20.5,'Il attaque et entraîne dans son antre tout ce qui\nbouge, sans distinction. Sa gueule est immense,\nmais son estomac est relativement petit.'),(652,664,'Lépidonille',0.3,2.5,'La poudre qui recouvre son corps l’aide à réguler\nsa température. Il peut s’adapter à tous les climats.'),(653,117,'Hypocéan',1.2,25.0,'Sa puissance de succion est si forte qu’il peut\naspirer en un instant ses proies pour les manger,\nmême si elles sont plus grosses que sa bouche.'),(654,389,'Torterra',2.2,310.0,'Il arrive que de petits Pokémon se rassemblent sur son dos\nimmobile pour y faire leur nid.'),(655,27,'Sabelette',0.6,12.0,'Il creuse le sol pour construire sa tanière.\nRien n’arrête ses griffes acérées, pas même\nla roche la plus solide.'),(656,853,'Krakos',1.6,39.0,'Mû par le besoin de tester la force de ses bras,\nil se rend sur la terre ferme pour trouver\nun adversaire. Il retourne à l’eau après le combat.'),(657,870,'Hexadron',3.0,62.0,'À six, ils représentent un Pokémon unique.\nIls peuvent changer de formation et comptent\nsur leur travail d’équipe en combat.'),(658,95,'Onix',8.8,210.0,'Il creuse dans le sol à une vitesse de 80 km/h\nen contorsionnant son immense corps de pierre.'),(659,721,'Volcanion',1.7,195.0,'Il évacue la vapeur qui s’accumule à l’intérieur de son corps\npar les bras situés sur son dos. Ce jet est assez puissant\npour raser des montagnes.'),(660,414,'Papilord',0.9,23.3,'Ce Pokémon s’active à la nuit tombée pour voler le miel\ndes Apitrini pendant leur sommeil.'),(661,819,'Rongourmand',0.3,2.5,'Comme il mange tout le temps des Baies, il est\nplus costaud qu’il n’en a l’air. Il parcourt les\nchamps à la recherche de sa précieuse denrée.'),(662,9,'Tortank',1.6,85.5,'Les canons sur sa carapace tirent des jets d’eau\ncapables de percer même de l’acier trempé.'),(663,755,'Spododo',0.2,1.5,'Il vit dans les forêts sombres même en plein jour.\nIl dissémine des spores clignotantes pour\nendormir ses ennemis.'),(664,637,'Pyrax',1.6,46.0,'Né d’un cocon enflammé, ce Pokémon apparaît\nsur d’anciennes fresques représenté comme\nune divinité du feu.'),(665,449,'Hippopotas',0.8,49.5,'Il est principalement actif pendant la journée.\nIl s’enfouit profondément dans le sable pour\ndormir, car les nuits désertiques sont très froides.'),(666,693,'Gamblast',1.3,35.3,'Sa pince droite est un canon pouvant projeter\ndes obus d’eau assez puissants pour couler\nun navire-citerne.'),(667,48,'Mimitoss',1.0,30.0,'Ses grands yeux lui servent de radar. En pleine\nlumière, on peut y distinguer des facettes.'),(668,99,'Krabboss',1.3,60.0,'Sa pince gigantesque possède une puissance\ndestructrice phénoménale, mais hors combat,\nson poids devient un handicap.'),(669,362,'Oniglali',1.5,256.5,'Il a le pouvoir de geler l’humidité ambiante\nen un instant et peut ainsi immobiliser ses proies.'),(670,530,'Minotaupe',0.7,40.4,'On l’appelle le « roi de la vrille ». Il creuse la terre\nà une vitesse pouvant atteindre 150 km/h.'),(671,448,'Lucario',1.2,54.0,'Étant capable de lire ce que pensent les humains,\nce Pokémon ne s’attache qu’aux Dresseurs dotés\nd’un cœur pur.'),(672,677,'Psystigri',0.3,3.5,'Il possède des pouvoirs psychiques si puissants\nqu’il peut faire valser un catcheur.\nMalheureusement, il a du mal à les contrôler.'),(673,686,'Sepiatop',0.4,3.5,'Il sape la combativité de son adversaire en faisant\nclignoter son corps lumineux, puis profite\nde cet instant de répit pour s’enfuir.'),(674,885,'Fantyrm',0.5,2.0,'Seul, il est si faible qu’il ne saurait rivaliser avec\nun enfant, mais en coop