r.'),(724,398,'Étouraptor',1.2,24.9,'Lorsque Étourvol évolue en Étouraptor, il quitte son groupe\npour vivre seul. Ses ailes sont très développées.'),(725,584,'Sorbouboul',1.3,57.5,'La température de son corps est d’environ\n- 6 °C. On raconte que ce Pokémon naît\nlorsque deux Sorboul se collent l’un à l’autre.'),(726,445,'Carchacrok',1.9,95.0,'Ce Pokémon très rapide même au sol capture\nses proies sur les monts enneigés et rentre vite\ndans son antre avant que son corps ne gèle.'),(727,696,'Ptyranidur',0.8,26.0,'Capricieux, il veut toujours être le centre\nde l’attention. Il peut gravement blesser\nson Dresseur en essayant de jouer avec lui.'),(728,472,'Scorvol',2.0,42.5,'Il vole sans un bruit, et capture ses proies avec sa queue\npour leur infliger une morsure critique.'),(729,526,'Gigalithe',1.7,260.0,'Il est capable d’envoyer des boules d’énergie\nassez puissantes pour balayer un camion-benne,\nmais il ne peut tirer que les jours ensoleillés.'),(730,623,'Golemastoc',2.8,330.0,'Son énergie viendrait d’un mécanisme\nà mouvement perpétuel interne, mais jusqu’à\nprésent, personne n’en a la preuve.'),(731,401,'Crikzik',0.3,2.2,'Quand ses antennes s’entrechoquent, elles laissent échapper\nun bruit de xylophone.'),(732,649,'Genesect',1.5,82.5,'Un Pokémon existant depuis 300 millions d’années, et modifié\npar la Team Plasma. Il a maintenant un canon dans le dos.'),(733,653,'Feunnec',0.4,9.4,'Il a toujours une brindille avec lui en cas de petit creux.\nIl projette de l’air chaud par ses oreilles pour intimider\nses ennemis.'),(734,643,'Reshiram',3.2,330.0,'Selon un mythe, lorsque les gens ne font aucun\ncas de la Réalité et s’abandonnent à la cupidité,\nReshiram rase le pays entier avec ses flammes.'),(735,162,'Fouinar',1.8,32.5,'Fouinar est très mince. Lorsqu’il est attaqué, il peut\ns’enfuir en se faufilant habilement dans les recoins étroits.\nMalgré ses pattes courtes, ce Pokémon est très agile\net rapide.'),(736,735,'Argouste',0.7,14.2,'D’un naturel très patient, il ne peut toutefois\ns’empêcher de bondir sur son plat favori,\nRattata, s’il en voit un.'),(737,862,'Ixon',1.6,46.0,'Il a évolué après avoir enchaîné de nombreux\ncombats. Le cri qu’il pousse lorsqu’il fait un « X »\navec ses bras ébranle n’importe quel ennemi.'),(738,402,'Mélokrik',1.0,25.5,'Il exprime ses émotions par des mélodies. Les scientifiques\nétudient actuellement leur structure.'),(739,113,'Leveinard',1.1,34.6,'Ce Pokémon lent à l’origine a appris à fuir\nplus vite pour protéger ses œufs des voleurs.'),(740,355,'Skelénox',0.8,15.0,'Ce Pokémon devient invisible pour se rapprocher\nfurtivement de ses proies.\nIl a le pouvoir de traverser les murs.'),(741,712,'Grelaçon',1.0,99.5,'Il vit dans les régions les plus froides, agrippé\naux Séracrawl. Il gèle ses pattes sur leur dos\npour se maintenir en place.'),(742,108,'Excelangue',1.2,65.5,'Excelangue se nourrit essentiellement de Pokémon\nInsecte. Il lèche ses ennemis avec sa longue langue\npour les paralyser, puis les avale tout rond.'),(743,444,'Carmache',1.4,56.0,'Il cache des pierres précieuses dans le sol\nde sa grotte, et accueille à coups de griffes\net de crocs quiconque ose y pénétrer.'),(744,896,'Blizzeval',2.2,800.0,'Ce Pokémon à la force hors du commun porte\nun masque composé de glace cent fois plus\nsolide que le diamant.'),(745,218,'Limagma',0.7,35.0,'Les veines de Limagma ne contiennent pas de sang.\nAu lieu de ça, du magma en fusion circule dans le corps\nde ce Pokémon, apportant les nutriments et l’oxygène\nnécessaires à ses organes.'),(746,519,'Poichigeon',0.3,2.1,'Il n’est pas très malin et un peu distrait,\nmais beaucoup de Dresseurs l’apprécient pour\nson caractère affectueux et sa bonne volonté.'),(747,424,'Capidextre',1.2,20.3,'Il utilise toujours ses deux queues pour faire\nla moindre tâche. Il s’en sert aussi pour enlacer\nles gens qu’il affectionne tout particulièrement.'),(748,847,'Hastacuda',1.3,30.0,'Il charge d’un coup en faisant tourner sa nageoire\ncaudale. Il peut transpercer ses proies\nà une vitesse dépassant les 100 nœuds.'),(749,128,'Tauros',1.4,88.4,'Les Tauros vivant à Galar ont un tempérament\nviolent et ne tolèrent pas que les êtres humains\nmontent sur leur dos.'),(750,403,'Lixy',0.5,9.5,'Sa fourrure s’illumine grâce à l’électricité.\nIl agite l’extrémité lumineuse de sa queue\npour envoyer des signes à ses congénères.'),(751,100,'Voltorbe',0.5,10.4,'On dit qu’il se déguise en Poké Ball.\nIl s’autodétruit à la moindre stimulation.'),(752,325,'Spoink',0.7,30.6,'Spoink garde une perle sur sa tête. Elle lui sert à amplifier\nses pouvoirs télékinétiques. Il est constamment en quête\nd’une perle plus grosse.'),(753,299,'Tarinor',1.0,97.0,'Grâce à sa force magnétique, il peut chasser\nses proies sans se déplacer, mais il attire\nparfois ses pires ennemis.'),(754,93,'Spectrum',1.6,0.1,'On dit que lorsque quelqu’un a l’impression\nd’être surveillé dans le noir, c’est sûrement\nqu’un Spectrum se trouve dans les parages.'),(755,360,'Okéoké',0.6,14.0,'Ces Pokémon adorent se déplacer en groupe.\nIls se blottissent les uns contre les autres\ndans des cavernes pour dormir.'),(756,597,'Grindur',0.6,18.8,'Il aime les grottes pleines de mousse.\nLes enzymes contenues dans ces plantes l’aident\nà obtenir des épines grandes et solides.'),(757,849,'Salarsen',1.6,40.0,'Impatient et bagarreur, ce Pokémon avale\nde grandes gorgées d’eau croupie pour\nen absorber toute la toxicité.'),(758,794,'Mouscoto',2.4,333.6,'Ce type d’Ultra-Chimère adore exhiber\nses muscles gonflés à l’extrême.'),(759,495,'Vipélierre',0.6,8.1,'Il laisse sa queue prendre le soleil pour sa photosynthèse.\nQuand il est malade, sa queue pend tristement.'),(760,707,'Trousselin',0.2,3.0,'Il absorbe les ions métalliques avec l’appendice\nsur sa tête. Il paraît qu’il ressemble à une clé\ncar il tient à imiter cet objet qu’il aime tant.'),(761,799,'Engloutyran',5.5,888.0,'Cette créature inconnue appelée\n« Ultra-Chimère » semble constamment\naffamée : elle mange en permanence.'),(762,815,'Pyrobut',1.4,33.0,'Exceptionnel en attaque comme en défense,\nil s’exalte quand on l’encourage, mais il lui\narrive de se mettre en danger en jouant solo.'),(763,790,'Cosmovum',0.1,999.9,'Il aspire avec force la poussière de l’atmosphère\net travaille sans relâche pour produire dans\nson noyau l’énergie nécessaire à son évolution.'),(764,585,'Vivaldaim',0.6,19.5,'Quand la saison change, il change de pelage et d’odeur.\nUn Pokémon qui annonce le passage des saisons.'),(765,283,'Arakdo',0.5,1.7,'Il vit dans les lacs ou les marais où prospèrent\nles plantes hydrophiles. Il se dispute souvent\nproies et territoire avec son voisin, Araqua.'),(766,535,'Tritonde',0.5,4.5,'Il communique avec ses compagnons en émettant\ndes ondes. Son cri d’alerte est inaudible\npour les humains et les autres Pokémon.'),(767,385,'Jirachi',0.3,1.1,'On raconte que lorsqu’il se réveille de\nson sommeil millénaire, il exauce les vœux\nécrits sur les rubans de papier de sa tête.'),(768,507,'Ponchien',0.9,14.7,'Les poils sombres qui recouvrent son dos sont\nsi épais et si souples qu’ils peuvent même\nrepousser des crocs acérés.'),(769,278,'Goélise',0.6,9.5,'Il niche dans les falaises.\nEn utilisant les courants d’air, il peut voler\nsans battre des ailes.'),(770,475,'Gallame',1.6,52.0,'Ses sens aiguisés lui indiquent lorsque quelqu’un\nest en danger. Il accourt alors à la rescousse.'),(771,751,'Araqua',0.3,4.0,'Il vit principalement dans l’eau, mais s’il a besoin\nde s’aventurer sur la terre ferme pour chasser\nses proies, il protège sa tête avec une bulle d’eau.'),(772,766,'Quartermac',2.0,82.8,'Ils vivent en groupes de vingt individus où chacun\na un rôle précis, ce qui leur a permis de survivre\ndans un environnement impitoyable.'),(773,770,'Trépassable',1.3,250.0,'Bien qu’il déteste l’eau, il vit sur les plages.\nQuand la pluie s’abat sur lui, il est incapable\nde conserver sa forme de château de sable.'),(774,807,'Zeraora',1.5,44.5,'Il envoie des décharges électriques avec\nles coussinets de ses pattes. Quand il court,\non peut voir des éclairs et entendre la foudre.'),(775,787,'Tokotoro',1.9,45.5,'Il est le gardien d’Ula-Ula et le maître\ndes plantes. Il évite les combats inutiles en\nfaisant tinter sa queue pour signaler son arrivée.'),(776,774,'Météno',0.3,40.0,'Sa carapace, pourtant très solide, éclate\nen mille morceaux quand il s’écrase sur\nla terre en tombant du ciel.'),(777,478,'Momartik',1.3,26.6,'Il gèle ses proies avec son souffle à - 50 °C,\nles amène dans son antre, puis les y aligne\navec soin.'),(778,240,'Magby',0.7,21.4,'Il vit près des volcans. À la fin de la journée,\nil se détend dans un bon bain de magma.'),(779,887,'Lanssorien',3.0,50.0,'Il paraît que les Fantyrm installés dans ses cornes\nattendent impatiemment le moment où ils seront\npropulsés à la vitesse du son.'),(780,750,'Bourrinos',2.5,920.0,'Il a assez d’endurance pour arpenter tout Galar\nsans relâche en tirant des charges dépassant\nles dix tonnes.'),(781,546,'Doudouvet',0.3,0.6,'Les marques de luxe utilisent les étoffes\nsplendides issues du mélange des cotons\nde Doudouvet et de Blancoton.'),(782,764,'Guérilande',0.1,0.3,'Ce Pokémon dégage un parfum agréable\nqui varie d’un spécimen à l’autre, car chaque\nGuérilande s’habille de fleurs différentes.'),(783,551,'Mascaïman',0.7,15.2,'Malgré son petit gabarit, il a beaucoup de force\ndans les pattes arrière. Il parcourt le désert\ncomme s’il nageait dans le sable.'),(784,419,'Mustéflott',1.1,33.5,'Il a développé une bouée pour poursuivre ses proies\naquatiques. Elle fait office de canot gonflable.'),(785,550,'Bargantua',1.0,18.0,'On l’utilisait autrefois en cuisine.\nLa chair grasse des Bargantua à motif rouge\nétait plutôt destinée aux jeunes.'),(786,877,'Morpeko',0.3,3.0,'Il a beau manger, il a tout le temps faim.\nIl a toujours des graines grillées à l’électricité\nsur lui.'),(787,784,'Ékaïser',1.6,78.2,'Dans les ruines, on trouve parfois des fresques\nreprésentant des guerriers antiques qui portent\ndes armures faites avec ses écailles.'),(788,589,'Lançargot',1.0,33.0,'Il charge ses ennemis en brandissant ses lances.\nIl existe un célèbre tableau représentant la joute\nentre un Lançargot et un Palarticho.'),(789,776,'Boumata',2.0,212.0,'Il vit dans les volcans. Le soufre dont il se nourrit\nrend sa carapace explosive. Même ses selles\nsont dangereuses, car elles sont instables.'),(790,89,'Grotadmorv',1.2,30.0,'Son odeur immonde provoque des\névanouissements. Son odorat s’est atrophié\nà cause de sa propre puanteur.'),(791,891,'Wushours',0.6,12.0,'Lorsqu’il tire sur les longs poils blancs\nsur sa tête, il devient plus combatif et\nde l’énergie jaillit de sous son nombril.'),(792,536,'Batracné',0.8,17.0,'Il lui arrive de pousser des cris ravissants.\nPlus ses protubérances sont grosses,\nplus le son porte loin.'),(793,366,'Coquiperl',0.4,52.5,'La perle de Coquiperl est tellement précieuse\nqu’elle peut valoir plus de dix fois la valeur\nde celle de Kokiyas.'),(794,212,'Cizayox',1.8,118.0,'Malgré son corps fin, sa puissance de frappe\nest prodigieuse, car même ses muscles sont\ncomposés de métal.'),(795,878,'Charibari',1.2,100.0,'Les travaux physiques, c’est son affaire.\nSon corps de cuivre rouille sous la pluie\net prend une vive couleur verte.'),(796,666,'Prismillon',1.2,17.0,'Selon le climat de sa région d’origine, les motifs de ses ailes\nsont différents. Il sème des écailles aux couleurs vives.'),(797,106,'Kicklee',1.5,49.8,'Kicklee peut rétracter et étendre ses jambes\nà sa guise. La formidable allonge dont il dispose\nlui permet de frapper des adversaires éloignés.'),(798,617,'Limaspeed',0.8,25.3,'Il est bien plus agile sans sa coquille.\nLa membrane en forme de bandelettes\nqui l’entoure l’empêche de se dessécher.'),(799,691,'Kravarech',1.8,81.5,'Il sort la crête sur sa tête à la surface de l’eau\net l’expose à la lumière du soleil pour produire\nde l’énergie draconique.'),(800,823,'Corvaillus',2.2,75.0,'Grâce à son adresse remarquable en vol\net sa grande intelligence, il travaille comme\ntaxi volant de Galar.'),(801,639,'Terrakium',1.9,260.0,'Selon une légende d’Unys, Terrakium se serait\njadis dressé contre les humains pour protéger\nles Pokémon.'),(802,102,'Noeunoeuf',0.4,2.5,'Il a besoin d’être constitué de ses six membres\npour rester calme. Sitôt qu’il en manque un,\nil lui prend soudainement l’envie de fuir.'),(803,97,'Hypnomade',1.6,75.6,'Évitez son regard quand vous en croisez un,\nou il pourrait essayer de vous hypnotiser\navec son pendule.'),(804,347,'Anorith',0.7,12.5,'Ce Pokémon peut nager très vite en agitant\nses huit ailes comme des rames de bateau.\nIl fait partie des ancêtres des Pokémon Insecte.'),(805,160,'Aligatueur',2.3,88.8,'Aligatueur impressionne ses ennemis en ouvrant son\nénorme gueule. Pendant les combats, il piétine le sol\nde ses puissantes pattes arrière avant de charger ses\nadversaires à pleine vitesse.'),(806,185,'Simularbre',1.2,38.0,'Il se déguise en arbre pour éviter de se faire\nattaquer. Il déteste l’eau et se cache par temps\nde pluie.'),(807,426,'Grodrive',1.2,15.0,'Il attrape des personnes et des Pokémon pour\nles transporter vers une destination inconnue.'),(808,144,'Artikodin',1.7,55.4,'Il possède le pouvoir de contrôler la glace.\nSelon les dires, il vivrait sur les sommets\nrecouverts de neiges éternelles.'),(809,719,'Diancie',0.7,8.8,'Il peut créer une multitude de diamants en un instant\nen serrant ses mains, simplement en compressant\nles molécules de carbone contenues dans l’air.'),(810,634,'Diamat',1.4,50.0,'Ses deux têtes se disputent la même proie.\nIl est toujours couvert de blessures, même\ns’il n’a affronté personne.'),(811,630,'Vaututrice',1.2,39.5,'Il se pare d’ossements qu’il a ramassés.\nIl semblerait qu’il choisisse la forme des os\nqu’il porte selon les dernières tendances.'),(812,727,'Félinferno',1.8,83.0,'Bien qu’il soit parfois brutal, il sait aussi\nse montrer attentionné en venant en aide\naux petits Pokémon.'),(813,838,'Wagomine',1.1,78.0,'Il peut faire tourner ses pattes très vite\npour se déplacer à une vitesse de 30 km/h.\nIl peut aussi souffler des flammes à 1 000 °C.'),(814,655,'Goupelin',1.5,39.0,'Ses pouvoirs psychiques lui permettent de créer\ndes tourbillons de flammes à 3 000 °C qui enveloppent\net consument ses ennemis.'),(815,804,'Mandrillon',3.6,150.0,'Cette Ultra-Chimère utilise son aiguillon pour\nsécréter un venin toxique, luisant et gluant.'),(816,123,'Insécateur',1.5,56.0,'Si l’on voit un grand nombre d’arbres abattus au\nmême endroit dans une forêt, cela signifie que\nl’on se trouve sur le territoire d’un Insécateur.'),(817,154,'Méganium',1.8,100.5,'Le parfum de la fleur de Méganium apaise et calme les esprits.\nPendant les combats, ce Pokémon émet son parfum relaxant\npour atténuer l’agressivité de l’ennemi.'),(818,889,'Zamazenta',2.9,210.0,'Ce Pokémon, changé en statue, est resté pétrifié\nsi longtemps qu’il a failli tomber dans l’oubli.'),(819,161,'Fouinette',0.8,6.0,'Lorsqu’un Fouinette dort, un autre monte la garde.\nLa sentinelle réveille les autres au moindre signe de danger.\nSi un de ces Pokémon est séparé de sa meute, il est incapable\nde dormir, car il a peur.'),(820,796,'Câblifère',3.8,100.0,'Certains spécimens de ce type d’Ultra-Chimère\nplantent leurs membres dans le sol à la manière\nd’un arbre et restent immobiles.'),(821,703,'Strassie',0.3,5.7,'On raconte qu’il existerait quelque part dans\nle monde un filon regorgeant de Strassie,\nqui abriterait également leur reine.'),(822,312,'Négapi',0.4,4.2,'Négapi adore encourager son partenaire pendant les combats.\nDes étincelles jaillissent alors de son corps. Lorsque son\npartenaire est en difficulté, le corps de ce Pokémon libère\nencore plus d’étincelles.'),(823,844,'Dunaconda',3.8,65.5,'S’il s’enroule d’une manière aussi particulière,\nc’est pour optimiser l’expulsion de sable\npar ses narines.'),(824,687,'Sepiatroce',1.5,47.0,'On raconte que ses pouvoirs hypnotiques\nseraient à l’origine d’évènements qui ont\nbouleversé le cours de l’Histoire.'),(825,759,'Nounourson',0.5,6.8,'Sa façon de remuer les pattes pour se défendre\nsemble adorable, mais ce Pokémon est si puissant\nqu’il pourrait fendre un tronc de la sorte.'),(826,884,'Duralugon',1.8,40.0,'Son corps, composé d’un métal spécial, est léger\net lui offre une excellente mobilité. Il est toutefois\nsensible à la pluie et vit donc dans les grottes.'),(827,327,'Spinda',1.1,5.0,'Chaque Spinda possède un pelage unique.\nCe Pokémon esquive les attaques de son\nadversaire grâce à d’imprévisibles oscillations.'),(828,633,'Solochi',0.8,17.3,'Comme il ne voit rien, il se repère en mâchouillant\ntout ce qui se trouve autour de lui.'),(829,446,'Goinfrex',0.6,105.0,'Il conserve sa nourriture sous son épaisse fourrure.\nIl lui arrive d’en offrir un peu à ceux en qui\nil a confiance.'),(830,829,'Tournicoton',0.4,2.2,'Nombreux sont ceux qui ont décidé d’en élever\nun après avoir été charmés par sa manière\nde chanter en virevoltant au gré de la brise.'),(831,602,'Anchwatt',0.2,0.3,'Tout seul, il ne dégage pas beaucoup d’électricité.\nMais un banc d’Anchwatt produit des décharges surpuissantes.'),(832,834,'Torgamord',1.0,115.5,'Son cou extensible lui permet d’atteindre\ndes ennemis éloignés en un instant pour leur\nporter un coup décisif avec ses crocs aiguisés.'),(833,786,'Tokopiyon',1.2,18.6,'Bien qu’on le considère comme une divinité\nprotectrice, cette incarnation parfaite de\nla nature est aussi innocente que cruelle.'),(834,661,'Passerouge',0.3,1.7,'Quand il est surexcité, sa température corporelle\naugmente d’un coup, à tel point qu’il est possible\nde se brûler en le touchant à mains nues.'),(835,768,'Sarmuraï',2.0,108.0,'Il vit dans des trous ou des épaves au fond\nde l’océan. Il se bat souvent contre Krakos,\net le perdant sert de repas au gagnant.'),(836,155,'Héricendre',0.5,7.9,'Héricendre se protège en faisant jaillir des flammes de\nson dos. Ces flammes peuvent être violentes si le Pokémon\nest en colère. Cependant, s’il est fatigué, seules quelques\nflammèches vacillent laborieusement.'),(837,119,'Poissoroy',1.3,39.0,'S’il fait des trous dans les rochers avec sa corne\npour bâtir son nid, c’est pour éviter que ses Œufs\nne soient emportés par les flots.'),(838,281,'Kirlia',0.8,20.2,'Il peut distordre l’espace-temps grâce\nà ses pouvoirs psychiques et ainsi voir l’avenir.'),(839,168,'Migalos',1.1,33.5,'Il capture ses proies en projetant un fil qu’il\nsécrète. À la nuit tombée, il quitte sa toile\net part chasser activement.'),(840,711,'Banshitrouye',0.9,12.5,'Les soirs de nouvelle lune, il frappe aux portes\ndes maisons. Si quelqu’un a le malheur de lui\nouvrir, il l’emporte aussitôt dans l’au-delà.'),(841,116,'Hypotrempe',0.4,8.0,'Hypotrempe crée des tourbillons en dansant\nsous l’eau. Il s’amuse à comparer la taille des\nremous qu’il fait avec ceux de ses congénères.'),(842,717,'Yveltal',5.8,203.0,'Quand il sent que la fin de sa vie est proche, il aspire la force\nvitale des êtres vivants et retourne à l’état de cocon.'),(843,146,'Sulfura',2.0,60.0,'On raconte qu’il a sauvé des personnes perdues\nen montagne en illuminant les sentiers à l’aide\nde ses splendides ailes flamboyantes.'),(844,723,'Efflèche',0.7,16.0,'Il prend grand soin de son plumage, s’assurant\nainsi d’avoir une apparence impeccable\net des plumes aiguisées à souhait.'),(845,382,'Kyogre',4.5,352.0,'Un Pokémon considéré comme l’avatar des océans.\nSelon les légendes, il a disputé de nombreux combats\navec Groudon pour contrôler l’énergie de la nature.'),(846,167,'Mimigal',0.5,8.5,'Le poison contenu dans les mandibules de\nce Pokémon n’est pas très violent, mais il suffit\nà immobiliser les proies piégées dans sa toile.'),(847,729,'Otarlette',0.6,17.5,'Les soirs où la mer est calme, il danse\navec ses congénères au son des chants\nd’Oratoria, le chef du groupe.'),(848,145,'Électhor',1.6,52.6,'On raconte que lorsque ce Pokémon oiseau\nlégendaire fait vibrer ses plumes, le frottement\nfait tomber la foudre instantanément.'),(849,127,'Scarabrute',1.5,55.0,'Une fois sa proie enserrée entre ses cornes,\ndeux choix s’offrent à lui : la couper en deux\nou la projeter au loin de toutes ses forces.'),(850,153,'Macronium',1.2,15.8,'Le cou de Macronium est entouré de nombreuses feuilles.\nDans chacune d’elles se trouve une pousse d’arbre. Le parfum\nde cette pousse donne la pêche aux personnes qui le sentent.'),(851,115,'Kangourex',2.2,80.0,'Certains documents certifient que les Kangourex\nsans progéniture élevaient des enfants humains\nen détresse.'),(852,596,'Mygavolt',0.8,14.3,'Il piège les oisillons qui ne savent pas encore\nvoler en tissant une toile électrique près des nids\ndes Pokémon oiseaux.'),(853,900,'Hachécateur',1.8,89.0,''),(854,306,'Galeking',2.1,360.0,'Il y a fort longtemps, un roi portait un casque\nà l’effigie de Galeking, pensant qu’il pourrait\nainsi s’approprier sa force.'),(855,361,'Stalgamin',0.7,16.8,'Il ne peut vivre que dans les plus froides contrées.\nIl s’accommode parfaitement de températures\natteignant les - 100 °C.'),(856,345,'Lilia',1.0,23.8,'Accroché aux rochers des profondeurs, il attend\nqu’une proie s’approche de lui pour l’attraper\navec ses tentacules en forme de pétales.'),(857,245,'Suicune',2.0,187.0,'Suicune incarne la tranquillité d’une source d’eau pure.\nIl parcourt les plaines avec grâce. Ce Pokémon a le pouvoir\nde purifier l’eau.'),(858,410,'Dinoclier',0.5,57.0,'On retrouve des fossiles de Dinoclier dans\nles couches sédimentaires préhistoriques, mais\nseule sa tête a résisté à l’épreuve du temps.'),(859,905,'Amovénus',1.6,48.0,''),(860,257,'Braségali',1.9,52.0,'Braségali a des jambes incroyablement puissantes. Il peut\nsauter par-dessus un immeuble de trente étages. Les coups\nde poing enflammés de ce Pokémon peuvent carboniser\nses ennemis.'),(861,298,'Azurill',0.2,2.0,'C’est un Pokémon docile, mais si on l’énerve,\nil n’hésite pas à frapper en faisant tournoyer\nla grosse boule au bout de sa queue.'),(862,295,'Brouhabam',1.5,84.0,'Pour communiquer avec ses semblables,\nil n’utilise pas que son cri puissant ; il émet\naussi des sons par les trous de son corps.'),(863,681,'Exagide',1.7,53.0,'Grâce à ses puissants pouvoirs spirituels,\nil a contrôlé des humains et des Pokémon\npour créer un pays conforme à ses idéaux.'),(864,648,'Meloetta',0.6,6.5,'Sa voix si particulière lui permet de chanter des mélodies\nqui ensorcellent les gens et modifient leurs émotions.'),(865,903,'Farfurex',1.3,43.0,''),(866,319,'Sharpedo',1.8,88.8,'Surnommé le « tyran des mers », ce Pokémon\nattaque sans exception tous les navires\nqui osent s’aventurer sur son territoire.'),(867,409,'Charkos',1.6,102.5,'Pokémon préhistorique célèbre pour ses coups\nde tête puissants et son petit cerveau, son\nextinction serait due à son extrême bêtise.'),(868,733,'Bazoucan',1.1,26.0,'Les couples de Bazoucan sont réputés pour leur\nharmonie. On en amène souvent aux mariages\npour porter bonheur aux jeunes époux.'),(869,310,'Élecsprint',1.5,40.2,'Ce Pokémon évite de se montrer aux humains.\nOn raconte qu’il fait son nid aux endroits\noù la foudre s’est abattue.'),(870,380,'Latias',1.4,40.0,'Latias est très intelligent et comprend le langage des hommes.\nIl est recouvert d’une espèce de duvet ressemblant à du verre.\nCe Pokémon s’enveloppe dans ce duvet et reflète la lumière\npour changer son apparence.'),(871,674,'Pandespiègle',0.6,8.0,'Il dévisage toujours ses adversaires d’un air\nrenfrogné pour être pris au sérieux, mais dès que\nla tension retombe, son sourire reprend le dessus.'),(872,368,'Rosabyss',1.8,22.6,'Il se nourrit en aspirant les fluides corporels\nde ses proies. Le reste tombe au fond de la mer,\nnourrissant ainsi d’autres Pokémon.'),(873,411,'Bastiodon',1.3,149.5,'Un Pokémon éteint depuis environ 100 millions\nd’années. Sa tête incroyablement solide était\nplus dure que l’acier.'),(874,726,'Matoufeu',0.7,25.0,'Quand il fait face à un adversaire redoutable,\nil redouble de combativité et la puissance\ncalorifère de sa clochette augmente.'),(875,647,'Keldeo',1.4,48.5,'Lorsqu’il livre un combat difficile, la corne\nsur son front se renforce et se développe,\nce qui éveillerait sa véritable puissance.'),(876,304,'Galekid',0.4,60.0,'Quand il évolue, il perd son armure d’acier.\nAutrefois, les gens la ramassaient pour\nen faire usage dans leur vie quotidienne.'),(877,317,'Avaltout',1.7,80.0,'Avaltout n’a pas de dents, ce qui le force à tout avaler en\nune bouchée. Quand il bâille, sa bouche prend une taille\nimpressionnante, et on pourrait y placer une roue de voiture.'),(878,367,'Serpang',1.7,27.0,'Il habite dans les profondeurs de l’océan.\nUn Serpang trouvé sur la plage serait\nun mauvais présage.'),(879,704,'Mucuscule',0.3,2.8,'Ses cornes sont des organes sensoriels qui lui\npermettent de se cacher quand il détecte des\nennemis. C’est grâce à cela qu’il vit toujours.'),(880,383,'Groudon',3.5,950.0,'Grâce à l’énergie de la nature, il peut accomplir\nsa Primo-Résurgence pour retrouver son apparence originelle.\nCe pouvoir lui permet de créer du magma pour étendre\nles continents.'),(881,392,'Simiabraz',1.2,55.0,'Il fait voltiger ses ennemis grâce à sa vitesse et son style\nde combat spécial qui utilise ses quatre membres.'),(882,631,'Aflamanoir',1.4,58.0,'Il se sert de sa flamme comme d’une langue.\nIl fait fondre peu à peu l’exosquelette des Fermite\npour se délecter de leur chair.'),(883,694,'Galvaran',0.5,6.0,'Il peut générer de l’électricité grâce au soleil.\nSi on le dérange en pleine production d’énergie,\ncela le stresse et l’affaiblit.'),(884,738,'Lucanon',1.5,45.0,'S’il emporte un Chrysapile en tant que batterie\nde secours, il peut tirer une salve de rayons\nélectriques extrêmement puissants en plein vol.'),(885,882,'Hydragon',2.3,215.0,'Ses pattes robustes lui permettent de courir\nà plus de 60 km/h, mais en revanche, il ne peut\nrespirer que sous l’eau.'),(886,351,'Morphéo',0.3,0.8,'Il n’y a pas que son apparence qui change en\nfonction de la météo : son tempérament aussi !\nPlus il y a de vent, plus il se montre agressif.'),(887,736,'Larvibule',0.4,4.4,'Il creuse son terrier dans le sol de la forêt\navec ses grandes mandibules.\nIl raffole de la sève sucrée.'),(888,413,'Cheniselle',0.5,6.5,'Quand Cheniti a évolué, sa cape a fusionné avec son corps.\nCheniselle ne s’en sépare jamais.'),(889,855,'Polthégeist',0.2,0.4,'Dès qu’il voit un reste de thé noir, il se verse\ndedans pour donner naissance à un Polthégeist.'),(890,300,'Skitty',0.6,11.0,'On sait que Skitty court souvent après sa queue.\nÀ l’état sauvage, ce Pokémon vit dans les cavités des arbres\nde la forêt. Il est tellement adorable qu’il a un grand succès\ncomme animal de compagnie.'),(891,357,'Tropius',2.0,100.0,'Dans les régions où il fait chaud, on trouve des\nfermes dédiées à l’élevage de ce Pokémon, très\napprécié pour les fruits poussant sur son cou.'),(892,428,'Lockpin',1.2,33.3,'À la fin de la saison chaude, il mue et se recouvre\nd’une fourrure épaisse et légère pour se préparer\nà affronter le froid hivernal.'),(893,436,'Archéomire',0.5,60.5,'On raconte qu’il se met à briller et à refléter\nla vérité quand on le polit, mais il a horreur\nde cela.'),(894,651,'Boguérisse',0.7,29.0,'Il renforce ses membres inférieurs en se ruant violemment\nsur ses congénères. Naturellement paisible, il ne provoque\njamais un combat.'),(895,675,'Pandarbare',2.1,136.0,'Il anticipe les mouvements de son adversaire\ngrâce à sa feuille. Ses coups de poing peuvent\nréduire un camion-benne en un tas de ferraille.'),(896,453,'Cradopaud',0.7,23.0,'Dilué, son poison sert de remède. Cela lui a valu\nde devenir la mascotte populaire d’une entreprise\nde produits pharmaceutiques.'),(897,497,'Majaspic',3.3,63.0,'Il peut paralyser l’ennemi d’un regard. Il amplifie l’énergie\ndu soleil dans son corps.'),(898,732,'Piclairon',0.6,14.8,'Il crache violemment les noyaux des Baies\nqu’il a mangées. Ils s’éparpillent au sol\net donnent naissance à de nouvelles plantes.'),(899,290,'Ningale',0.5,5.5,'Il peut passer plus de dix ans sous terre.\nLes racines des arbres constituent son régime\nalimentaire.'),(900,292,'Munja',0.8,1.2,'Cet étrange Pokémon, dont le corps\nest comme une coquille vide, ne respire pas\net peut voler sans battre des ailes.'),(901,451,'Rapion',0.8,12.0,'Il attaque avec les pinces empoisonnées\nde sa queue. Le venin se répand alors\ndans le corps de la victime et la paralyse.'),(902,431,'Chaglam',0.5,3.9,'Lorsqu’il est heureux, sa queue décrit des arabesques\ncomme un ruban de gymnastique rythmique.'),(903,274,'Pifeuil',1.0,28.0,'Il vit dans les trous des grands arbres.\nLe sifflement qu’il produit avec sa feuille\nsuffit à remplir ses adversaires d’effroi.'),(904,388,'Boskara',1.1,97.0,'Il sait d’instinct où trouver une source d’eau pure.\nIl y transporte d’autres Pokémon sur son dos.'),(905,44,'Ortide',0.8,8.6,'Ce qui semble être sa bave est en fait du nectar\ntrès collant. Si on le touche, il est très difficile\nde s’en dépêtrer.');
